(858,29,2023,5,440.7900,'2023-08-16 07:10:10','2023-09-21 05:04:26',10,'La cobertura de acueducto hace énfasis al servicio de agua potable en términos de suscriptores o usuarios atendidos, lo que indica que para el mes de mayo se obtuvo 306 nuevos suscriptores residenciales, con un acumulado de 2010 suscriptores, cumpliendo con la meta propuesta por la empresa, esto permite mejorar la prestación de servicio de agua potable lo que asegura que los usuarios tengan acceso al agua.'),
(859,29,2023,1,344.3000,'2023-08-16 07:33:34','2024-03-05 10:19:30',10,'La cobertura de acueducto se refiere a la extensión del servicio de agua potable en términos de suscriptores o usuarios atendidos, lo que indica que para el mes de enero se obtuvo 239 nuevos suscriptores residenciales, con un acumulado de 1570 suscriptores, cumpliendo con la meta establecida por la empres, esto permite mejorar la prestación de servicio de agua potable y asegurar que más personas tengan acceso a agua segura y confiable.'),
(860,29,2023,2,352.6300,'2023-08-16 07:39:31','2023-09-21 04:49:18',10,'La cobertura de acueducto énfasis del servicio de agua potable en términos de suscriptores o usuarios atendidos, lo que indica que para el mes de febrero se obtuvo 38 nuevos suscriptores residenciales, con un acumulado de 1608 suscriptores, cumpliendo con la meta propuesta por la empresa, esto permite mejorar la prestación de servicio de agua potable y asegurar que más personas tengan acceso a agua segura y confiable'),
(861,30,2023,1,101.4900,'2023-08-22 06:54:08','2024-07-25 06:06:32',13,'El indicador de cumplimiento de metas de continuidad acueducto, en el periodo de enero, obtuvo una continuidad del servicio, 101.49%, y un cumplimiento del 100% establecido por el PGR.\n\nLo que refleja el cumplimiento de metas de continuidad de acueducto es fundamental para evaluar la capacidad de proporcionar un suministro de agua confiable y constante a los usuarios, la continuidad del servicio hace refiere a la disponibilidad ininterrumpida de agua potable para los consumidores. '),
(862,17,2023,1,23.9600,'2023-08-22 07:00:31','2023-10-17 05:50:19',13,'Se observa el indicador del índice de continuidad de acueducto al periodo de enero presenta una frecuencia de 23.93 horas/día, logrando la meta establecida y con un cumplimiento de 100.13% establecido en el IUS. \n\nLo que señala que el índice de continuidad de acueducto tiene la disponibilidad constante del suministro de agua potable, esto contribuye al bienestar de la ciudad asegurando un suministro de agua confiable y constante.'),
(863,48,2023,1,72.7300,'2023-08-22 07:14:10','2024-07-30 06:02:41',13,'La meta actual del 90% no se está cumpliendo el cual arrojo un 72.73 % para el mes de enero, dado a que se están ejecutando contratos que llevarán a cabo la instalación de algunos macro medidores de caudal en el sistema de distribución de la empresa, adicional a esto se han presentado inconvenientes en algunos tanques, debido a estar en zonas susceptibles a descargas eléctricas\nLo que señala que el Índice de Macromedición Efectiva es esencial para asegurar que los sistemas de medición de la entidad operen de manera precisa, confiable y eficiente, a las salidas de los sistemas de potabilización, tanques de almacenamiento de agua potable y/o sistemas de bombeo\n'),
