(903,74,2023,7,95.4100,'2023-09-01 02:38:21','2024-01-24 10:33:47',28,'Se esta cumpliendo la meta del 80,65% para el año tarifario 7 año 2023, que va desde enero a diciembre, al encontrarse en 93,46% mes a corte de julio de 2023,  el área comercial por medio de su personal técnico, esta constantemente valorando estrategias para ir modernizando el parque de micromedición, cumpliendo con especificaciones técnicas y adoptando tecnologías actuales, lo anterior con el fin de generar confianza y tranquilidad con los usuarios, así mismo el área técnica esta constantemente planeando y ejecutando proyectos para ir mejorando las infraestructura física del acueducto, se implementan actividades para disminuir los daños de las redes de distribución y perdida de agua en las tuberías, minimizando las perdidas de IANC, directamente en el subprograma técnico. \n'),
