(1160,49,2023,9,95.5500,'2023-11-17 05:37:32','2023-11-17 06:00:49',27,'para el periodo de septiembre de 2023 el indicador se afecto en 95,55 %. En este periodo no se realiza brigada de cambio de medidores obsoletos y frenados por la empresa, ni se realizó brigada de retiro de medidores para laboratorio, por falta de personal.'),
(1161,12,2023,9,98.9500,'2023-11-17 05:39:05','2023-11-17 05:59:21',27,'El indicador de cobertura de medición correspondiente al periodo de septiembre de 2023, se encuentra en 98,95%, indicador muestra un leve incremento por las actividades  de financiación de de medidores por obsolescencia tecnológica y a la cantidad de medidores aportado por los usuarios. además no se realizó brigada de retiros de medidores frenados.\n\nContinuamos emitiendo comunicados a los predios que presentan novedades y son reportados por el área de facturación. Se debe cumplir el objetivo del contenido de los oficios.'),
(1162,112,2023,9,96.5600,'2023-11-17 05:39:05','2023-11-17 05:57:47',27,'En el periodo de agosto de 2023, el indicador se afecto en un 96,56%, por falta de personal operativo en la unidad de micro medición, los procesos se ven afectados, reflejados en el incumplimiento de las metas.\n\nPor medio de comunicado personalizados, se da la opción al usuario de comprar el medidor y traerlo para la empresa proceda a instalarlo. Dar cumplimiento al usuario con lo citado en el oficio de un periodo para instalar por parte de la empresa'),
