(1165,31,2023,10,150.6700,'2023-11-22 07:39:34','2024-01-09 10:56:00',28,'El índice de perdida por usuario facturado es de 6.40m3 lo cual indica que se esta cumpliendo la meta en un 141% para el año tarifario 7 de enero a diciembre del 2023, la meta para esta vigencia es del 100%, a corte al 31 de octubre del 2023, gracia al esfuerzo del área comercial, que por medio de su personal técnico, esta constantemente valorando estrategias para ir modernizando el parque de micromedición, cumpliendo con especificaciones técnicas y adoptando tecnologías actuales, lo anterior con el fin de generar confianza y tranquilidad con los usuarios, así mismo el área técnica esta constantemente planeando y ejecutando proyectos para ir mejorando las infraestructura física del acueducto, se implementan actividades para disminuir los daños de las redes de distribución y perdida de agua en las tuberías, minimizando las perdidas de IANC, directamente en el subprograma técnico. \n'),
(1166,120,2023,10,100.0000,'2023-11-27 10:38:27','2024-01-12 07:42:17',3,'La imperativa necesidad de garantizar una disponibilidad ininterrumpida en la infraestructura de Serviciudad ESP, la cual brinda servicios tecnológicos esenciales para que los recaudadores puedan consumir el webservice de transacciones de pagos, resalta la importancia de establecer metas claras en cuanto a la continuidad operativa. En este contexto, se plantea una meta de disponibilidad del 97% a lo largo del mes, siendo conscientes de que el restante 3% se asigna estratégicamente para llevar a cabo actualizaciones y mantenimientos preventivos, los cuales, por su naturaleza, generan períodos de breves indisponibilidades.\n\nEsta estrategia se fundamenta en el reconocimiento de la necesidad de mantener la infraestructura tecnológica alineada con los estándares más actuales y en pleno funcionamiento. El 97% de disponibilidad establecido se erige como un equilibrio prudente entre la exigencia de mantener operativos los servicios críticos y la necesidad de realizar intervenciones planificadas destinadas a optimizar y asegurar la estabilidad a largo plazo del sistema.\n\nEl enfoque adoptado refleja una gestión consciente y proyectada, donde la infraestructura no es simplemente un componente operativo, sino una entidad dinámica que evoluciona y se adapta a las demandas cambiantes del entorno tecnológico. La búsqueda constante de la mejora y la resiliencia a través de actualizaciones y mantenimientos preventivos respalda la visión de Serviciudad ESP como un referente en la provisión de servicios tecnológicos confiables y eficaces, fundamentales para los procesos de recaudación de pagos.\n\nLa consecución exitosa de la meta del 100% en el mes de OCTUBRE de 2023 constituye un logro significativo para Serviciudad ESP. La planificación estratégica de los servicios de mantenimiento y actualización, llevada a cabo durante horarios de madrugada, emerge como un factor clave en la consecución de este hito.\n\nLa elección de realizar las intervenciones durante las horas de menor demanda operativa demuestra un entendimiento profundo de las dinámicas de uso de los servicios tecnológicos. La madrugada, al ser un periodo de menor actividad por parte de los usuarios, proporciona un espacio propicio para llevar a cabo las actualizaciones y mantenimientos sin afectar significativamente la experiencia del usuario final ni comprometer la disponibilidad del sistema.'),
(1167,114,2023,10,100.0000,'2023-11-27 10:40:15','2024-01-12 07:15:42',3,'Para el mes de octubre se presentaron 21 requerimientos todo dentro de los tiempos establecidos en Acuerdo al Nivel de Servicio ANS como:(capacitación de software windows11, mantenimiento preventivo y correctivo, mantenimiento impresoras, sistema de información SIA, y restablecimiento de contraseñas, y el ingreso del técnico grado 1)'),
