(1188,74,2023,10,100.2800,'2023-12-28 06:56:39','2024-01-02 02:21:15',3,'Se esta cumpliendo la meta del 80,65% para el año tarifario 7 año 2023, que va desde enero a diciembre, al encontrarse en 94,52% mes a corte de octubre de 2023,  el área comercial por medio de su personal técnico, esta constantemente valorando estrategias para ir modernizando el parque de micromedición, cumpliendo con especificaciones técnicas y adoptando tecnologías actuales, lo anterior con el fin de generar confianza y tranquilidad con los usuarios, así mismo el área técnica esta constantemente planeando y ejecutando proyectos para ir mejorando las infraestructura física del acueducto, se implementan actividades para disminuir los daños de las redes de distribución y perdida de agua en las tuberías, minimizando las perdidas de IANC, directamente en el subprograma técnico. \n'),
(1189,50,2023,12,0.0300,'2024-01-05 05:45:30','2024-03-06 07:00:07',20,'Después de analizar los resultados de las características reportado por el laboratorio interno de villa santana  se analizaron en el mes de diciembre  97 muestras fisicoquímicas y 97 muestras microbiológicas. \nse reporta en el mes de diciembre IRCA 0.03% con un nivel de riesgo sin riesgo,  agua apta para el consumo humano. \nClasificación del IRCA\n	\n    SIN Riesgo	          BAJO 	         MEDIO 	     ALTO	                INVIABLE SANITARIAMENTE\n    0.0 - 5.0 %	               5.1 – 14 %	        14.01 – 35 %	     35.1 - 80 %	           80.1 - 100 %'),
(1190,16,2023,12,1.0000,'2024-01-05 05:45:42','2024-11-25 04:38:32',20,'En el mes de diciembre del 2023 se tomaron muestras para determinar la de la calidad de agua para consumo humano como control de la empresa Serviciudad esp.  Las cuales fueron 97 muestras fisicoquímicas y 97 muestras microbiológicas en la red de distribución en 15 puntos de muestreo, para ser analizadas en el laboratorio interno. \n\nDespués de ser analizados los parámetros de las muestras por el profesional, se concluye que sus aguas son aptas para el consumo humano en  lo definido en la Resolución 2115 de 2007.\n\nSin embargo Durante la vigencia 2023, las muestras de control de calidad del agua \nobtuvieron un Índice de Riesgo de la Calidad del Agua (IRCA) promedio de \n0,04%. Este resultado indica que el agua es apta para consumo humano, \ncumpliendo con los estándares de calidad establecidos por la normativa, que \ndefinen un rango de eficiencia entre 0% y 5%'),
(1191,29,2023,9,182.0200,'2024-01-10 07:13:40','2024-03-05 10:07:18',3,'La cobertura de acueducto se refiere a la extensión del servicio de agua potable en términos de suscriptores o usuarios atendidos, lo que indica que para el mes de septiembre se obtuvo 396 nuevos suscriptores residenciales, con un acumulado de 830 suscriptores, cumpliendo con la mesta establecida por la empresa, en urbanizaciones como Matiz, Olmo, asimismo se realizaron independizaciones, nuevas matriculas y activaciones, esto permite mejorar la prestación de servicio de agua potable y asegurar que los usuarios tengan acceso a agua segura y confiable.'),
(1192,29,2023,10,189.0400,'2024-01-10 07:16:05','2024-03-05 10:36:18',3,'La cobertura de acueducto se refiere a la extensión del servicio de agua potable en términos de suscriptores o usuarios atendidos, lo que indica que para el mes de octubre se obtuvo 32 nuevos suscriptores residenciales, con un acumulado de 862 suscriptores, cumpliendo con la meta establecida por la empres, esto permite mejorar la prestación de servicio de agua potable y asegurar que más personas tengan acceso a agua segura y confiable.'),
(1193,29,2023,11,222.8100,'2024-01-10 07:18:16','2024-03-05 10:37:36',3,'La cobertura de acueducto se refiere a la extensión del servicio de agua potable en términos de suscriptores o usuarios atendidos, lo que indica que para el mes de noviembre se obtuvo 154 nuevos suscriptores residenciales, con un acumulado de 1016 suscriptores, cumpliendo con la meta establecida por la empres, esto permite mejorar la prestación de servicio de agua potable y asegurar que más personas tengan acceso a agua segura y confiable.'),
(1194,33,2023,9,153.4600,'2024-01-10 08:23:42','2024-03-05 10:56:44',3,'La cobertura de alcantarillado, es importante para medir la y evaluar el acceso de las personas a servicios de saneamiento básico, lo que indica que para el mes de septiembre se obtuvo 390 nuevos suscriptores residenciales, con un acumulado de 8211 suscriptores, lo cual  asegurar que más usuarios tengan acceso a sistemas de eliminación segura de aguas residuales.'),
