(1206,5,2023,12,84.1200,'2024-01-11 05:51:18','2024-12-02 03:42:46',3,'Determina la cantidad de kilómetros de barrido al mes, considerando tanto las rutas programadas como las efectivamente ejecutadas, con el fin de evaluar el desempeño operativo, identificar áreas con alta demanda de limpieza y optimizar los recursos humanos y técnicos. Además, es importante analizar las variaciones estacionales, el nivel de residuos generados y las condiciones climáticas que puedan afectar la frecuencia y la eficiencia del servicio de barrido, asegurando así una cobertura integral y sostenible.\n\nEsto indica que la cobertura de barrido no se ejecutó en su totalidad, alcanzando un total de 5,733 km recorridos, frente a los 6,815 km programados, lo que representa un cumplimiento del 84.11%. Este desempeño pone de manifiesto que las actividades en esta área no han sido implementadas de manera óptima, evidenciando una insuficiencia en la asignación de personal para llevar a cabo las tareas de barrido de manera eficiente.\n\nPor ende, la brecha entre lo programado y lo ejecutado sugiere la necesidad de revisar los recursos disponibles, la planificación operativa y la distribución de las rutas para maximizar la cobertura. También es importante evaluar la incorporación de tecnología o maquinaria que pueda complementar el trabajo manual, así como implementar estrategias de capacitación y motivación del personal para mejorar la productividad y alcanzar los objetivos propuestos.'),
(1207,12,2023,10,99.1600,'2024-01-12 05:05:04','2024-01-12 05:37:35',27,'El indicador de cobertura de medición correspondiente al periodo de octubre de 2023, se encuentra en 99,16%, indicador muestra un incremento por las actividades de financiación de de medidores por obsolescencia tecnológica y a la cantidad de medidores aportado por los usuarios. además no se realizó brigada de retiros de medidores frenados.\n\nContinuamos emitiendo comunicados a los predios que presentan novedades y son reportados por el área de facturación. Se debe cumplir el objetivo del contenido de los oficios.'),
(1208,49,2023,10,95.2900,'2024-01-12 05:06:53','2024-01-12 05:38:36',27,'para el periodo de octubre de 2023 el indicador se afecto en 95,29 %. En este periodo no se realiza brigada de retiro de medidores para laboratorio, por falta de personal, incrementado medidores que no funciona por frenado.'),
(1209,112,2023,10,96.1000,'2024-01-12 05:06:53','2024-01-12 05:35:39',27,'En el periodo de octubre de 2023, el indicador se afecto en un 96,10%, por falta de personal operativo en la unidad de micro medición, los procesos se ven afectados, reflejados en el incumplimiento de las metas, donde no se realiza brigada de retiros de medidor para laboratorio.\n\nPor medio de comunicado personalizados, se da la opción al usuario de comprar el medidor y traerlo para la empresa proceda a instalarlo. Dar cumplimiento al usuario con lo citado en el oficio de un periodo para instalar por parte de la empresa'),
(1210,120,2023,1,100.0000,'2024-01-12 06:16:29','2024-01-12 07:33:21',41,'\nLa imperativa necesidad de garantizar una disponibilidad ininterrumpida en la infraestructura de Serviciudad ESP, la cual brinda servicios tecnológicos esenciales para que los recaudadores puedan consumir el webservice de transacciones de pagos, resalta la importancia de establecer metas claras en cuanto a la continuidad operativa. En este contexto, se plantea una meta de disponibilidad del 97% a lo largo del mes, siendo conscientes de que el restante 3% se asigna estratégicamente para llevar a cabo actualizaciones y mantenimientos preventivos, los cuales, por su naturaleza, generan períodos de breves indisponibilidades.\n\nEsta estrategia se fundamenta en el reconocimiento de la necesidad de mantener la infraestructura tecnológica alineada con los estándares más actuales y en pleno funcionamiento. El 97% de disponibilidad establecido se erige como un equilibrio prudente entre la exigencia de mantener operativos los servicios críticos y la necesidad de realizar intervenciones planificadas destinadas a optimizar y asegurar la estabilidad a largo plazo del sistema.\n\nEl enfoque adoptado refleja una gestión consciente y proyectada, donde la infraestructura no es simplemente un componente operativo, sino una entidad dinámica que evoluciona y se adapta a las demandas cambiantes del entorno tecnológico. La búsqueda constante de la mejora y la resiliencia a través de actualizaciones y mantenimientos preventivos respalda la visión de Serviciudad ESP como un referente en la provisión de servicios tecnológicos confiables y eficaces, fundamentales para los procesos de recaudación de pagos.\n\nLa consecución exitosa de la meta del 100% en el mes de enero de 2023 constituye un logro significativo para Serviciudad ESP. La planificación estratégica de los servicios de mantenimiento y actualización, llevada a cabo durante horarios de madrugada, emerge como un factor clave en la consecución de este hito.\n\nLa elección de realizar las intervenciones durante las horas de menor demanda operativa demuestra un entendimiento profundo de las dinámicas de uso de los servicios tecnológicos. La madrugada, al ser un periodo de menor actividad por parte de los usuarios, proporciona un espacio propicio para llevar a cabo las actualizaciones y mantenimientos sin afectar significativamente la experiencia del usuario final ni comprometer la disponibilidad del sistema.'),
