(1232,58,2023,7,0.3800,'2024-01-12 09:10:08','2024-01-17 10:26:25',21,'Para el indicador de productividad operativo de alcantarillado, en el periodo de julio se obtuvo 0.38 con respecto a la meta del 0.42, lo que indica que no logro un buen desempeño, con un cumplimiento 90.48% de normalización de acuerdo al IUS.\n\nLo que Corresponde a la medición de la proporción de trabajadores operativos existentes por, cada 1.000 suscriptores para el servicio público domiciliario de alcantarillado, y evalúa el desempeño, la eficiencia de los trabajadores que operan y mantienen la infraestructura, distribución y funcionamiento eficiente de los sistemas de alcantarillado y la gestión adecuada de los recursos humanos.'),
(1233,57,2023,7,1.0900,'2024-01-12 09:10:53','2024-03-05 09:19:51',21,'Para el indicador de productividad operativo de acueducto, en el periodo de julio, obtuvo 1.09 lo cual logró un buen desempeño con respecto a la meta, con un cumplimiento del 100 de normalización de acuerdo al IUS. \n\nLo que Corresponde a la medición de la proporción de trabajadores operativos existentes por cada 1.000 suscriptores para el servicio público domiciliario de acueducto y evalúa el desempeño, la eficiencia de los trabajadores que operan y mantienen la infraestructura de distribución del agua.\n'),
(1234,59,2023,7,1.7900,'2024-01-12 09:11:17','2024-01-17 10:32:55',21,'Para el indicador de productividad operativo de aseo, en el periodo de julio se obtuvo 1.79 el cual logró un buen desempeño con respecto a la meta del 1.06, con un cumplimiento 168.87%\n\nLo que Corresponde a la medición de la proporción de trabajadores operativos existentes por cada 1.000 suscriptores para el servicio público domiciliario de Aseo, evalúa y mejorar la eficiencia en la limpieza y mantenimiento de espacios públicos o privados; con un proceso continuo que requiere atención constante y ajustes a medida que se identifican áreas a mejorar para optimizar los recursos y garantizar un ambiente limpio y saludable para las personas que utilizan los espacios que se mantienen.'),
