(1317,85,2023,12,100.0000,'2024-01-16 10:18:34','2024-11-25 10:17:23',14,'Se informa que para la vigencia todos los componentes del indicador son reportados dentro del documento denominado PLAN DE EMERGENCIA Y CONTINGENCIA DE SERVICIUDAD ESP. \n\nAsimismo, se realiza elaboración del documento denominado Plan de Emergencia y Contingencia, donde se clasifican y se analizan los riesgos por servicio y se tienen en cuenta todos los componentes solicitados en el indicador. El documento antes mencionado incluye directrices en caso de la ocurrencia de algún evento que se presente en la entidad.\n\nDurante el año 2023, la entidad cumplió con todos los reportes requeridos \npara la Actualización del Plan de Emergencias y Contingencias para los \nservicios de acueducto y alcantarillado. Los reportes incluyen: \n• Inventario de equipos AAA \n• Recursos financieros AAA \n• Plan de Contingencia (en formato PDF) \n• Registro de Eventos \n• Cuestionario de Eventos \n• Registro de Amenazas \n\nEste cumplimiento integral asegura que la entidad esté preparada para enfrentar \ncualquier eventualidad, garantizando la continuidad y calidad de los servicios \nante situaciones de emergencia. \n'),
(1318,86,2023,12,100.0000,'2024-01-16 10:18:38','2024-11-25 10:08:06',14,'Se informa que para la vigencia todos los componentes del indicador son reportados dentro del documento denominado PLAN DE EMERGENCIA Y CONTINGENCIA DE SERVICIUDAD ESP. \n\nAsimismo, se realiza elaboración del documento denominado Plan de Emergencia y Contingencia, donde se clasifican y se analizan los riesgos por servicio y se tienen en cuenta todos los componentes solicitados en el indicador. El documento antes mencionado incluye directrices en caso de la ocurrencia de algún evento que se presente en la entidad.\n\nEsto también indica que durante el año 2023, la entidad cumplió con todos los reportes requeridos para la Actualización del Plan de Emergencias y Contingencias para los servicios de acueducto y alcantarillado. Los reportes incluyen: \n\n• Inventario de equipos AAA \n• Recursos financieros AAA \n• Plan de Contingencia (en formato PDF) \n• Registro de Eventos \n• Cuestionario de Eventos \n• Registro de Amenazas \n\nEste cumplimiento integral asegura que la entidad esté preparada para enfrentar \ncualquier eventualidad, garantizando la continuidad y calidad de los servicios \nante situaciones de emergencia. \n'),
