(1322,57,2023,12,1.0400,'2024-01-17 11:02:25','2024-03-05 09:29:40',3,'Corresponde a la medición de la proporción de trabajadores operativos existentes, por cada 1.000 suscriptores para el servicio público domiciliario de acueducto, y evalúa el desempeño, la eficiencia de los trabajadores que operan y mantienen la infraestructura de distribución del agua.\n\nPara el indicador de productividad operativo de acueducto, en el periodo de diciembre se obtuvo 1.04 con respecto a la meta 1.02 sobrepasando el 100% de cumplimiento  de normalización de acuerdo al IUS.\n\n'),
(1323,58,2023,12,0.3500,'2024-01-17 11:02:38','2024-03-05 09:42:39',3,'El indicador de productividad operativo de alcantarillado, en el periodo de diciembre se obtuvo 0.35 lo que indica que no logro un buen desempeño con respecto a la meta del 0.42, con un cumplimiento 83.33% de normalización de acuerdo al IUS.\n\nLo que Corresponde a la medición de la proporción de trabajadores operativos existentes por cada 1.000 suscriptores para el servicio público domiciliario de alcantarillado, y evalúa el desempeño, la eficiencia de los trabajadores que operan y mantienen la infraestructura, distribución y funcionamiento eficiente de los sistemas de alcantarillado y la gestión adecuada de los recursos humanos.'),
(1324,59,2023,12,1.7500,'2024-01-17 11:02:57','2024-01-18 10:40:16',3,'Para el indicador de productividad operativo de aseo, en el periodo de diciembre se obtuvo 1.75 el cual logró un buen desempeño con respecto a la meta del 1.06, con un cumplimiento 165.09%\n\nLo que Corresponde a la medición de la proporción de trabajadores operativos existentes por cada 1.000 suscriptores para el servicio público domiciliario de Aseo, evalúa y mejorar la eficiencia en la limpieza y mantenimiento de espacios públicos o privados; con un proceso continuo que requiere atención constante y ajustes a medida que se identifican áreas a mejorar para optimizar los recursos y garantizar un ambiente limpio y saludable para las personas que utilizan los espacios que se mantienen.'),
