(1347,74,2023,12,98.2900,'2024-01-18 07:00:51','2024-11-25 10:26:40',28,'Se esta cumpliendo la meta del 80,65% para el año tarifario 7 año 2023, que va desde enero a diciembre, al encontrarse en 98,29% mes a corte de diciembre de 2023,  el área comercial por medio de su personal técnico, esta constantemente valorando estrategias para ir modernizando el parque de micromedición, cumpliendo con especificaciones técnicas y adoptando tecnologías actuales, lo anterior con el fin de generar confianza y tranquilidad con los usuarios, así mismo el área técnica esta constantemente planeando y ejecutando proyectos para ir mejorando las infraestructura física del acueducto, se implementan actividades para disminuir los daños de las redes de distribución y perdida de agua en las tuberías, minimizando las perdidas de IANC, directamente en el subprograma técnico. \n\nsin embargo para la vigencia 2023, ingresaron al sistema 13.355.288 m³ de agua. El consumo medido fue de 7.819.573 m³, y el consumo no medido fue de 434.369 m³. Basado en estos datos, la pérdida total durante el periodo fue de 5.101.346 m³, lo que equivale a un Índice de Pérdidas por Usuario Facturado (IPUF) de 6.44 m³/suscriptor-mes, superando el estándar regulatorio de 6 m³/suscriptor-mes. A pesar de esto, el valor ha disminuido progresivamente según las metas de reducción de pérdidas establecidas en el marco tarifario, alcanzando un 96.15% de agua controlada en puntos de uso y consumo.'),
(1348,31,2023,12,145.5700,'2024-01-18 07:02:34','2024-01-18 07:09:15',28,'El índice de perdida por usuario facturado es de 6.23m3 lo cual indica que se esta cumpliendo la meta en un 145% para el año tarifario 7 de enero a diciembre del 2023, la meta para esta vigencia es del 100%, a corte al 31 de diciembre del 2023, gracia al esfuerzo del área comercial, que por medio de su personal técnico, esta constantemente valorando estrategias para ir modernizando el parque de micromedición, cumpliendo con especificaciones técnicas y adoptando tecnologías actuales, lo anterior con el fin de generar confianza y tranquilidad con los usuarios, así mismo el área técnica esta constantemente planeando y ejecutando proyectos para ir mejorando las infraestructura física del acueducto, se implementan actividades para disminuir los daños de las redes de distribución y perdida de agua en las tuberías, minimizando las perdidas de IANC, directamente en el subprograma técnico. \n'),
