(1415,17,2023,12,23.9400,'2024-01-19 04:44:07','2024-11-25 05:07:18',13,'Se observa el indicador del índice de continuidad de acueducto al periodo de diciembre presenta una frecuencia de 23.94 horas/día, logrando la meta establecida y con un cumplimiento de 100.13% establecido en el IUS. \n\nLo que señala que el índice de continuidad de acueducto tiene la disponibilidad constante del suministro de agua potable, esto contribuye al bienestar de la ciudad asegurando un suministro de agua confiable y constante.\n\nIgualmente, Durante la vigencia 2023, el Índice de Continuidad Promedio del servicio fue  de 23,94 horas diarias, lo que representa un 99,73% de continuidad en la prestación del servicio de acueducto. Este alto nivel de continuidad refleja una gestión eficiente de los recursos y una infraestructura robusta, garantizando a los usuarios un suministro constante y confiable de agua.'),
