(1463,10,2023,12,82.5100,'2024-01-29 10:56:32','2024-12-02 04:49:43',3,'Mide la cobertura del servicio de aseo respecto a los residuos sólidos ordinarios producidos en toda la ciudad, evaluando la eficiencia en la recolección, transporte y disposición final de los desechos. Este análisis debe incluir la identificación de áreas con cobertura insuficiente, el volumen total de residuos generados por sector, y la frecuencia de recolección en relación con las necesidades específicas de cada zona.\n\nEsto indica que la cobertura del servicio de aseo realizada por la empresa en el relleno sanitario durante el mes de diciembre fue de 3,868.15 toneladas, frente a una producción per cápita estimada de 4,800.00 toneladas, lo que representa un cumplimiento del 82.51% respecto al objetivo programado; este desempeño revela una brecha significativa en la gestión de residuos sólidos, lo que podría deberse a factores como la insuficiencia de recursos logísticos, la falta de optimización en las rutas de recolección o limitaciones en la capacidad operativa del relleno sanitario\n'),
