(1467,18,2023,12,0.0000,'2024-02-05 10:20:07','2024-11-25 05:26:43',36,'Durante el periodo de diciembre se recibieron un total de 098 PQRs del servicio de acueducto de las cuales el 100% fueron resultas durante el tiempo establecido por la normatividad vigente.\n\nLo que muestra que  el indicador IPQRAC, realiza las peticiones recibidas referentes al servicio de acueducto se le dieron tramite oportuno dentro del tiempo establecido dentro del marco de la ley 142 de 1994 y suscrito a través del contrato de condiciones uniformes, demuestra además que los procedimientos establecidos por la empresa para hacer recepción, control y respuesta en términos esta funcionando adecuadamente.\n\nLo que señala que en el año 2023, se recibieron 1.738 Peticiones, Quejas y Reclamos (PQR) relacionadas con el servicio de acueducto, esto indica que todas las PQR fueron atendidas dentro del plazo máximo establecido por la normativa vigente, demostrando el compromiso de la entidad con la atención al cliente y la resolución eficiente de inquietudes y problemas presentados por los usuarios.'),
(1468,19,2023,12,0.0000,'2024-02-05 10:20:25','2024-11-25 05:32:28',36,'Durante el periodo de diciembre se recepcionaron un total de 097 PQRs del servicio de alcantarillado de las cuales el 100% fueron resultas durante el tiempo establecido por la normatividad vigente.\n\nLo que indica que el indicador IPQRAL, realizo todas las peticiones recibidas referentes al servicio de alcantarillado se le dieron tramite oportuno dentro del tiempo establecido dentro del marco de la ley 142 de 1994 y suscrito a través del contrato de condiciones uniformes, demuestra además que los procedimientos establecidos por la empresa para hacer recepción, control y respuesta en términos esta funcionando adecuadamente.\n\nEn el año 2023, se recibieron 1.586 PQR relacionadas con el servicio de alcantarillado , lo que refleja la importancia de dar trámite a todas estas PQR ya que fueron atendidas dentro del \nplazo máximo establecido por la normativa vigente, demostrando el compromiso de la entidad con la atención al cliente y la resolución eficiente de inquietudes y problemas presentados por los usuarios'),
(1469,109,2023,12,56.2900,'2024-02-06 04:59:00','2024-02-20 11:00:05',7,'La meta establecida para este indicador era ejecutar el 50% de las actividades establecidas de acuerdo a los diferentes planes de mejoramiento en los procesos de auditorías, para la vigencia 2023 se dio cumplimiento a 94 de las 167 acciones por ejecutar.'),
(1478,50,2024,1,0.0700,'2024-02-15 06:06:22','2024-03-12 07:14:59',20,'Después de analizar los resultados reportado por el laboratorio interno de villa santana en el mes de enero, donde se tomaron 95 muestras fisicoquímicas y 95 muestras microbiológicas. Con un resultado del IRCA 0.07% se clasifica el IRCA con un nivel de riesgo sin riesgo  agua apta para el consumo humano, con Clasificación del IRCA:\n	\nSIN Riesgo	          BAJO 	         MEDIO 	     ALTO	                INVIABLE SANITARIAMENTE\n 0.0 - 5.0 %	        5.1 – 14 %      14.01 – 35 %	  5.1 - 80 %	               80.1 - 100 %\n'),
(1479,16,2024,1,1.0000,'2024-02-15 06:06:33','2024-03-12 07:11:11',20,'En el mes de enero del 2024 se tomaron muestras para determinar la de la calidad de agua para consumo humano como control de la empresa Serviciudad esp.  Las cuales fueron 95 muestras fisicoquímicas y 95 muestras microbiológicas en la red de distribución en 15 puntos de muestreo, para ser analizadas en el laboratorio interno de villa santana. \nDespués de ser analizados los parámetros de las muestras por el profesional se concluye que sus aguas son aptas para el consumo humano en lo definido en la Resolución 2115 de 2007.\n'),
