(1503,54,2023,12,100.0000,'2024-03-04 08:46:06','2024-11-14 08:01:17',34,'El indicador del PUEAA se encuentra al 100%, de acuerdo a la actualización que se realizó el 29 de octubre de 2019 donde fue aprobado este documento para cinco años por CARDER. Este documente o resolución No 2811 estará vigente hasta el 28 de octubre del 2024 donde se realizará la actualización de nuevo PUEAA para los próximos cinco años.\n\nPara el mismo periodo, la empresa cumplió plenamente con los indicadores de seguimiento de su Plan de Ahorro y Uso Eficiente del Agua, aprobado por la Autoridad Ambiental el 29 de octubre de 2019 para un período de 5 años (2020-2024) en el río Otún. Este plan vence en octubre del 2024, para el 2024 se deberá iniciar la actualización y solicitud de aprobación del nuevo PUEAA. Además, en abril del 2023 se obtuvo la aprobación para la quebrada Santa Elena y San Joaquín mediante la resolución 806 del 13 de abril 2023, con una vigencia de 5 años (2023-2027). Este cumplimiento demuestra el compromiso de la empresa con la sostenibilidad y la gestión eficiente de los recursos hídricos.'),
