(1524,64,2024,2,100.0000,'2024-04-02 06:17:48','2024-04-26 03:13:54',33,'El Indicador de Continuidad en la Recolección (ICTR) para el mes de febrero esta al 100% cumpliendo con la mesta establecida de acuerdo a los parámetros requeridos por el ente de control.\n\nSirve para evaluar la eficiencia y calidad de la recolección de los residuos en el municipio,  asimismo mide la continuidad y regularidad con la que se realiza la recolección de basura; para asegurar que se cumplan los estándares establecidos en el servicio de aseo.'),
(1525,91,2024,2,100.0000,'2024-04-02 06:24:05','2024-06-27 07:09:32',33,'En el periodo de febrero el horario de recolección se realiza al 100%, cumpliendo el 100% De acuerdo a lo establecido en la resolución CRA 720  en contabilizar semanalmente las frecuencias prestadas con un retraso superior a tres (3) horas,\n\nLo que refiere al programa aseo o plan establecido para recoger los residuos, basura o desechos de diferentes áreas, ya sea residenciales, comerciales o industriales. En este horario se especifica los días y las horas en que los camiones de recolección pasarán por cada ubicación para recolección de los desechos y transportarlos a un lugar adecuado para su tratamiento o eliminación. Establecer un horario de recolección eficiente es crucial para mantener la limpieza y la higiene en las áreas atendidas, así como para garantizar que los residuos se gestionen de manera adecuada y respetando las normativas ambientales, '),
(1526,104,2024,2,100.0000,'2024-04-02 06:24:48','2024-04-26 09:41:07',33,'La calidad técnica de la recolección se refiere a la precisión y eficiencia con la que se recopilan datos, información o muestras en un contexto específico. Esta medida evalúa cómo se lleva a cabo el proceso de recolección, asegurando que los datos obtenidos sean confiables, consistentes y representativos de la población o fenómeno estudiado. Aspectos clave de la calidad técnica de la recolección incluyen:\n\nMetodología adecuada: Utilizar métodos de recolección apropiados para el tipo de datos que se están recopilando, ya sean encuestas, entrevistas, observaciones directas, mediciones físicas, etc.\nDiseño de instrumentos: Desarrollar cuestionarios, formularios de recolección u otros instrumentos con preguntas claras, precisas y relevantes, así como con formatos adecuados para garantizar la comprensión y la uniformidad en las respuestas.\n\nCapacitación del personal: Capacitar al personal encargado de la recolección para que siga los procedimientos establecidos y mantenga la consistencia en la aplicación de los instrumentos y la interpretación de los datos.\n\nSupervisión y control de calidad: Implementar mecanismos de supervisión para monitorear el proceso de recolección, identificar posibles errores o sesgos, y corregirlos de manera oportuna.\n\nValidación y verificación: Verificar la precisión y la validez de los datos recolectados mediante pruebas piloto, análisis de consistencia interna, comparaciones con fuentes alternativas, entre otros métodos.\n\nGarantía de confidencialidad y ética: Asegurar la confidencialidad de la información recolectada y cumplir con los estándares éticos y legales relacionados con la privacidad y la protección de datos.\n\nRegistro y documentación: Mantener registros detallados de todas las actividades de recolección, incluyendo fechas, lugares, procedimientos utilizados y cualquier otro detalle relevante que pueda afectar la calidad de los datos.\n\nAl garantizar una alta calidad técnica en la recolección de datos, se mejora la fiabilidad y la utilidad de la información obtenida, lo que a su vez fortalece la validez y la credibilidad de los resultados de cualquier estudio o investigación.\n\n\n\n\n\n\n\n'),
(1527,114,2024,1,100.0000,'2024-04-02 07:47:59','2024-04-24 09:12:22',3,'En el mes de enero nos planteamos estar dentro de los tiempos establecidos en acuerdo de nivel de servicio ANS para los 20 requerimientos (soporte técnico preventivo y correctivo, mantenimiento impresoras, sistema de información SIA), de los cuales se cumplieron 18 asistencias dentro de los tiempos ANS'),
(1528,120,2024,1,100.0000,'2024-04-02 08:07:04','2024-04-24 09:11:55',41,'La imperativa necesidad de garantizar una disponibilidad ininterrumpida en la infraestructura de Serviciudad ESP, la cual brinda servicios tecnológicos esenciales para que los recaudadores puedan consumir el webservice de transacciones de pagos, resalta la importancia de establecer metas claras en cuanto a la continuidad operativa. En este contexto, se plantea una meta de disponibilidad del 97% a lo largo del mes, siendo conscientes de que el restante 3% se asigna estratégicamente para llevar a cabo actualizaciones y mantenimientos preventivos, los cuales, por su naturaleza, generan períodos de breves indisponibilidades.\n\nEsta estrategia se fundamenta en el reconocimiento de la necesidad de mantener la infraestructura tecnológica alineada con los estándares más actuales y en pleno funcionamiento. El 97% de disponibilidad establecido se erige como un equilibrio prudente entre la exigencia de mantener operativos los servicios críticos y la necesidad de realizar intervenciones planificadas destinadas a optimizar y asegurar la estabilidad a largo plazo del sistema.\n\nEl enfoque adoptado refleja una gestión consciente y proyectada, donde la infraestructura no es simplemente un componente operativo, sino una entidad dinámica que evoluciona y se adapta a las demandas cambiantes del entorno tecnológico. La búsqueda constante de la mejora y la resiliencia a través de actualizaciones y mantenimientos preventivos respalda la visión de Serviciudad ESP como un referente en la provisión de servicios tecnológicos confiables y eficaces, fundamentales para los procesos de recaudación de pagos.\n\nLa consecución exitosa de la meta del 100% en el mes de enero de 2024 constituye un logro significativo para Serviciudad ESP. La planificación estratégica de los servicios de mantenimiento y actualización, llevada a cabo durante horarios de madrugada, emerge como un factor clave en la consecución de este hito.\n\nLa elección de realizar las intervenciones durante las horas de menor demanda operativa demuestra un entendimiento profundo de las dinámicas de uso de los servicios tecnológicos. La madrugada, al ser un periodo de menor actividad por parte de los usuarios, proporciona un espacio propicio para llevar a cabo las actualizaciones y mantenimientos sin afectar significativamente la experiencia del usuario final ni comprometer la disponibilidad del sistema.'),
