(1578,112,2024,2,95.9600,'2024-04-17 04:16:35','2024-04-17 04:18:41',27,'En el periodo de febrero de 2024, el indicador se afecto en un 95,96%, el porcentaje no mejora, por falta de realiza brigada de cambio de medidores obsoletos y que se encuentran frenados, predios con el servicio directo y por no haber medidores en la empresa para financiar, y la falta personal operativo en el área, no se cumple con el objetivo de los comunicados, reflejando el incumplimiento de las metas.\n\nPor medio de comunicado personalizados, se da la opción al usuario de comprar el medidor y traerlo para la empresa y proceder a instalarlo. Dar cumplimiento al usuario con lo citado en el oficio de un periodo para instalar por parte de la empresa es importante para cumplir con las\nmetas.\n'),
(1579,112,2024,3,95.6400,'2024-04-18 06:59:47','2024-04-22 04:57:56',27,'En el periodo de marzo de 2024, el indicador se afecto en un 95,64%, el porcentaje no mejora, por falta de realiza brigada de cambio de medidores obsoletos y que se encuentran frenados, por no haber medidores en la empresa para financiar, además falta personal operativo en el área y la falta de instalar medidores en predios que tienen el servicio directo, se refleja el incumplimiento de las metas.\n\nPor medio de comunicado personalizados, se da la opción al usuario de comprar el medidor y traerlo para la empresa y proceder a instalarlo. Dar cumplimiento al usuario con lo citado en el oficio de un periodo para instalar por parte de la empresa es importante para cumplir con las\nmetas\n'),
(1580,59,2024,3,1.6500,'2024-04-19 03:08:30','2024-07-24 03:45:13',3,'Para el indicador de productividad operativo de aseo, en el periodo de marzo se obtuvo 1.65 el cual no logro un buen desempeño con respecto a la meta, de 1.78, y con un cumplimiento 92.70%.\n\nEsto Corresponde a la medición de la proporción de trabajadores operativos existentes por cada 1.000 suscriptores para el servicio público domiciliario de Aseo, evalúa y mejorar la eficiencia en la limpieza y mantenimiento de espacios públicos o privados; es un proceso continuo que requiere atención constante y ajustes a medida que se identifican áreas a mejorar para optimizar los recursos y garantizar un ambiente limpio y saludable para las personas que utilizan los espacios '),
(1581,12,2024,3,99.0800,'2024-04-19 03:08:51','2024-04-22 04:55:53',3,'El indicador de cobertura de medición correspondiente al periodo de marzo de 2024, se encuentra en 99,08%, la empresa solo a procedido a instalar medidores a predios aportado por los usuario. no se hace brigada de retiro de medidores frenados, no se realizó cambio de medidores que se encuentran obsoletos o en mal estado.\n\nCon relación a los comunicados a los predios que presentan novedades y son reportados \npor el área de facturación. se han enviado muy lentamente, esto debido a la falta del \npersonal en esta unidad, los objetivo del contenido de los oficios no se cumple\n'),
(1582,49,2024,3,94.7600,'2024-04-19 03:08:51','2024-04-22 05:03:54',3,'para el periodo de marzo de 2024 el indicador se afecto en 94,76 %. En este periodo por falta de medidores en la empresa no se realiza brigada del cambio del medidor por obsoleto y a predios con el servicio directo, no se hace brigada de retiro de medidores para laboratorio, la instalación de medidores aportado por los usuarios fue muy lenta por falta de personal.'),
(1583,57,2024,3,1.0200,'2024-04-19 03:08:51','2024-04-24 10:35:25',3,'Corresponde a la medición de la proporción de trabajadores operativos existentes, por cada 1.000 suscriptores para el servicio público domiciliario de acueducto, y evalúa el desempeño, la eficiencia de los trabajadores que operan y mantienen la infraestructura de distribución del agua.\n\nLo que señala que el indicador de productividad operativo de acueducto, en el periodo de marzo, obtuvo 1.02 con respecto a la meta del 1.06 lo que indica que no logro un buen desempeño, con un cumplimiento de normalización 96.23 % de acuerdo al IUS.\n\n'),
(1584,58,2024,3,0.3300,'2024-04-19 03:10:17','2024-04-24 10:41:43',3,'Para el indicador de productividad operativo de alcantarillado, en el periodo de marzo, continua siendo 0.33 con respecto a la meta del 0.45, lo que indica que no hay un buen logro y un buen desempeño,  lo que refleja un cumplimiento 77.33% de normalización de acuerdo al IUS.\n\nEsto corresponde a la medición de la proporción de trabajadores operativos existentes por, cada 1.000 suscriptores para el servicio público domiciliario de alcantarillado, y evalúa el desempeño, la eficiencia de los trabajadores que operan y mantienen la infraestructura, distribución y funcionamiento eficiente de los sistemas de alcantarillado y la gestión adecuada de los recursos humanos.'),
(1585,50,2024,2,0.0700,'2024-04-19 06:05:47','2024-04-19 06:12:12',20,'Después de analizar los resultados reportado por el laboratorio interno de villa santana en el mes de febrero, donde se tomaron 89 muestras fisicoquímicas y 89 muestras microbiológicas. Con un resultado del IRCA 0.07% se clasifica el IRCA con un nivel de riesgo sin riesgo agua apta para el consumo humano, con Clasificación del IRCA:  SIN RIESGO \n	\nSIN Riesgo	          BAJO 	         MEDIO 	     ALTO	                INVIABLE SANITARIAMENTE\n 0.0 - 5.0 %	        5.1 – 14 %      14.01 – 35 %	 5.1 - 80 %	               80.1 - 100 %\n'),
(1586,16,2024,2,1.0000,'2024-04-19 06:08:01','2024-04-19 06:11:45',20,'En el mes de febrero del 2024 se tomaron muestras para determinar la de la calidad de agua para consumo humano como control de la empresa Serviciudad esp.  Las cuales fueron 89 muestras fisicoquímicas y 95 muestras microbiológicas en la red de distribución en 15 puntos de muestreo, para ser analizadas en el laboratorio interno de villa santana. \n\nDespués de ser analizados los parámetros de las muestras por el profesional se concluye que sus aguas son aptas para el consumo humano en lo definido en la Resolución 2115 de 2007.\n\n\n\n'),
