(1588,16,2024,3,1.0000,'2024-04-19 06:13:20','2024-04-19 06:16:18',20,'En el mes de marzo del 2024 se tomaron muestras para determinar la de la calidad de agua para consumo humano como control de la empresa Serviciudad esp.  Las cuales fueron 95 muestras fisicoquímicas y 95 muestras microbiológicas en la red de distribución en 15 puntos de muestreo, para ser analizadas en el laboratorio interno de villa santana. \nDespués de ser analizados los parámetros de las muestras por el profesional se concluye que sus aguas son aptas para el consumo humano en lo definido en la Resolución 2115 de 2007.\n'),
(1589,120,2024,3,100.0000,'2024-04-19 06:14:35','2024-04-24 10:00:24',41,'La imperativa necesidad de garantizar una disponibilidad ininterrumpida en la infraestructura de Serviciudad ESP, la cual brinda servicios tecnológicos esenciales para que los recaudadores puedan consumir el webservice de transacciones de pagos, resalta la importancia de establecer metas claras en cuanto a la continuidad operativa. En este contexto, se plantea una meta de disponibilidad del 97% a lo largo del mes, siendo conscientes de que el restante 3% se asigna estratégicamente para llevar a cabo actualizaciones y mantenimientos preventivos, los cuales, por su naturaleza, generan períodos de breves indisponibilidades.\nEsta estrategia se fundamenta en el reconocimiento de la necesidad de mantener la infraestructura tecnológica alineada con los estándares más actuales y en pleno funcionamiento. El 97% de disponibilidad establecido se erige como un equilibrio prudente entre la exigencia de mantener operativos los servicios críticos y la necesidad de realizar intervenciones planificadas destinadas a optimizar y asegurar la estabilidad a largo plazo del sistema.\nEl enfoque adoptado refleja una gestión consciente y proyectada, donde la infraestructura no es simplemente un componente operativo, sino una entidad dinámica que evoluciona y se adapta a las demandas cambiantes del entorno tecnológico. La búsqueda constante de la mejora y la resiliencia a través de actualizaciones y mantenimientos preventivos respalda la visión de Serviciudad ESP como un referente en la provisión de servicios tecnológicos confiables y eficaces, fundamentales para los procesos de recaudación de pagos.\nLa consecución exitosa de la meta del 100% en el mes de febrero de 2023 constituye un logro significativo para Serviciudad ESP. La planificación estratégica de los servicios de mantenimiento y actualización, llevada a cabo durante horarios de madrugada, emerge como un factor clave en la consecución de este hito.\nLa elección de realizar las intervenciones durante las horas de menor demanda operativa demuestra un entendimiento profundo de las dinámicas de uso de los servicios tecnológicos. La madrugada, al ser un periodo de menor actividad por parte de los usuarios, proporciona un espacio propicio para llevar a cabo las actualizaciones y mantenimientos sin afectar significativamente la experiencia del usuario final ni comprometer la disponibilidad del sistema.\n'),
(1590,113,2024,3,90.9100,'2024-04-19 06:18:48','2024-04-24 10:00:43',41,'en este punto tenemos acta de inicio de 3 proyectos proyectados para esta vigencia y se cumplen a cabalidad todos los alcances que hasta la fecha se habían proyectado.'),
(1591,114,2024,3,100.0000,'2024-04-19 06:34:29','2024-04-24 10:01:01',41,'En el mes de marzo nos planteamos estar dentro de los tiempos establecidos en acuerdo de nivel de servicio ANS para los 16 requerimientos (soporte técnico preventivo y correctivo, mantenimiento impresoras, sistema de información SIA), de los cuales se cumplieron 18 asistencias dentro de los tiempos ANS\n'),
(1592,56,2024,3,1.2100,'2024-04-24 06:41:11','2024-10-29 08:45:34',3,'El indicador de productividad del personal administrativo, para el periodo de marzo obtuvo 1.21 con respecto a la meta 1.19 cumpliendo en un 84.03%  \n\nCorresponde a la medición de la proporción de trabajadores administrativos existentes, por cada 1.000 suscriptores para atender los servicios públicos prestados, y evalúa el desempeño, la eficiencia de los trabajadores e identificar oportunidades de mejora y optimización que impulsen el éxito de la organización.'),
(1593,6,2024,2,92.2700,'2024-04-24 06:53:15','2024-11-12 05:53:39',24,'El indicador de recaudo de acueducto para el periodo de febrero arrojo un 90.36% lo que señala que no obtuvo un alcance esperado, con respecto a la meta del 96.00% y con un cumplimiento de 99.11% \n\nEsto determina la proporción de los ingresos por prestación del servicio público domiciliario de acueducto facturado, Esto es fundamental para evaluar cómo se están gestionando los ingresos generados por la venta de agua potable, que contribuirá a garantizar que el servicio de acueducto cuente con los recursos financieros necesarios para operar y mantener su infraestructura, proporcionando así un suministro de agua confiable a sus usuarios.'),
(1594,7,2024,2,90.3600,'2024-04-24 06:53:40','2024-11-12 05:58:26',24,'El indicador recaudo de alcantarillado para el periodo de febrero presentó un 90.36%  lo que indica que no se logro lo establecido con respecto a la meta, y con un cumplimiento de 94.13%\n\nLo que determina la proporción de los ingresos por prestación del servicio público domiciliario de alcantarillado facturado, esto apunta a evaluar la gestión financiera y operativa del sistema de alcantarillado, con el fin optimizar recursos y garantizar que el sistema funcione de manera eficiente y sostenible, para garantizar que los ingresos sean suficientes para cubrir los costos operativos y de inversión, y que se brinde un servicio de calidad a los usuarios, y realizar de manera periódica el monitoreo el desempeño del sistema y tomar medidas correctivas cuando sea necesario.'),
(1595,8,2024,2,89.6200,'2024-04-24 06:54:09','2024-11-12 06:05:42',24,'En el periodo de febrero el recaudo de aseo obtuvo un 89.62% lo que indica que no se logro lo establecido con respecto a la meta del 96.00%, con un cumplimiento de 89.62% la frecuencia con que se recauda la calidad del proceso de facturación en el servicio de aseo\n\nLo que refiere a la evaluación y capacidad de la entidad encargada de la recolección de residuos sólidos y la prestación de servicios relacionados para obtener los ingresos necesarios para cubrir sus costos operativos y mantener la calidad del servicio, el cual es importante para garantizar la sostenibilidad financiera y la calidad del servicio de aseo, como también evalúa la capacidad de la empresa para obtener ingresos suficientes de cubrir sus costos y garantizar prestación.\n'),
