(1598,64,2024,1,100.0000,'2024-04-25 05:12:01','2024-04-26 03:11:59',33,'El Indicador de Continuidad en la Recolección (ICTR) para el mes de enero esta al 100% cumpliendo con la mesta establecida de acuerdo a los parámetros requeridos por el ente de control\n\nSirve para evaluar la eficiencia y calidad de la recolección de los residuos en el municipio,  asimismo mide la continuidad y regularidad con la que se realiza la recolección de basura; para asegurar que se cumplan los estándares establecidos en el servicio de aseo.'),
(1599,91,2024,1,100.0000,'2024-04-25 05:16:30','2024-07-23 04:49:12',33,'En el periodo de enero el horario de recolección se realiza al 100%, cumpliendo el 100% lo con los tiempos establecido en la resolución CRA 720, con los tiempos  \n\nLo que refiere al programa aseo o plan establecido para recoger los residuos, basura o desechos de diferentes áreas, para residenciales, comerciales o industriales. En este horario se especifica los días y las horas en que los camiones de recolección pasarán por cada ubicación para recolección de los desechos y transportarlos a un lugar adecuado para su tratamiento o eliminación. Establecer un horario de recolección eficiente es crucial para mantener la limpieza y la higiene en las áreas atendidas, así como para garantizar que los residuos se gestionen de manera adecuada y respetando las normativas ambientales, '),
(1600,104,2024,1,100.0000,'2024-04-25 05:22:13','2024-04-26 09:42:20',33,'La calidad técnica de la recolección se refiere a la precisión y eficiencia con la que se recopilan datos, información o muestras en un contexto específico. Esta medida evalúa cómo se lleva a cabo el proceso de recolección, asegurando que los datos obtenidos sean confiables, consistentes y representativos de la población o fenómeno estudiado. Aspectos clave de la calidad técnica de la recolección incluyen:\n\nMetodología adecuada: Utilizar métodos de recolección apropiados para el tipo de datos que se están recopilando, ya sean encuestas, entrevistas, observaciones directas, mediciones físicas, etc.\nDiseño de instrumentos: Desarrollar cuestionarios, formularios de recolección u otros instrumentos con preguntas claras, precisas y relevantes, así como con formatos adecuados para garantizar la comprensión y la uniformidad en las respuestas.\n\nCapacitación del personal: Capacitar al personal encargado de la recolección para que siga los procedimientos establecidos y mantenga la consistencia en la aplicación de los instrumentos y la interpretación de los datos.\n\nSupervisión y control de calidad: Implementar mecanismos de supervisión para monitorear el proceso de recolección, identificar posibles errores o sesgos, y corregirlos de manera oportuna.\n\nValidación y verificación: Verificar la precisión y la validez de los datos recolectados mediante pruebas piloto, análisis de consistencia interna, comparaciones con fuentes alternativas, entre otros métodos.\n\nGarantía de confidencialidad y ética: Asegurar la confidencialidad de la información recolectada y cumplir con los estándares éticos y legales relacionados con la privacidad y la protección de datos.\n\nRegistro y documentación: Mantener registros detallados de todas las actividades de recolección, incluyendo fechas, lugares, procedimientos utilizados y cualquier otro detalle relevante que pueda afectar la calidad de los datos.\n\nAl garantizar una alta calidad técnica en la recolección de datos, se mejora la fiabilidad y la utilidad de la información obtenida, lo que a su vez fortalece la validez y la credibilidad de los resultados de cualquier estudio o investigación.\n\n'),
(1601,2,2024,1,100.0000,'2024-04-25 05:36:34','2024-12-17 08:01:42',37,'La cobertura poda de árboles para el periodo de Enero realizo el 100% de los árboles que están dentro del PGIR de 2470, cumpliendo la meta establecida. del 100%.\n\nEsto refiere a la proporción de árboles que han sido podados en relación con el total de árboles presentes en el área, lo indica que es útil para evaluar el mantenimiento y la gestión de áreas arboladas, ya que una cobertura adecuada de poda contribuye a la salud, seguridad y estética de los árboles, así como al bienestar general del entorno urbano donde se realiza esta labor.'),
