(1605,2,2024,3,100.0000,'2024-04-25 05:54:09','2024-12-17 08:08:23',37,'La cobertura de poda de árboles correspondiente al periodo de marzo alcanzó el 100% de los árboles incluidos en el PGIR de 2441, cumpliendo así con la meta establecida.\n\nEsta acción no solo contribuye al mantenimiento y salud de los árboles, sino que también asegura la seguridad y el bienestar de la comunidad, al prevenir posibles riesgos derivados del crecimiento desmedido de las especies. Se ha logrado, así, un avance significativo en la gestión ambiental y el cuidado del entorno urbano.'),
(1606,4,2024,2,62.6300,'2024-04-25 07:40:40','2024-07-24 03:15:40',33,'Para el periodo de febrero en la cobertura de corte de césped se realizaron 327.767 mt2 en toda la zona urbana del municipio acorde a lo establecido por el PGIRS, lo que permite mantener con regularidad la apariencia y estética  de la ciudad.\n\nLo anterior refleja que del 80% de la meta establecida se esta realizando un 62..63% con un cumplimiento 78.29% esto señala que el indicador no esta cumpliendo con la meta pactada, lo cual refiere a la falta de personal para atender toda la cobertura establecida en el PGIRS.'),
