(1611,31,2024,3,144.8700,'2024-04-26 02:47:25','2024-04-26 03:01:46',28,'El índice de perdida por usuario facturado es de 6.24 m3,  lo cual indica que se esta cumpliendo la meta en un 149% para el año tarifario 8 de julio del 2023 a junio del 2024, la meta para esta vigencia es del 100%, a corte del 31 de marzo del 2024, gracia al esfuerzo del área comercial, que por medio de su personal técnico, esta constantemente valorando estrategias para ir modernizando el parque de micromedición, cumpliendo con especificaciones técnicas y adoptando tecnologías actuales, lo anterior con el fin de generar confianza y tranquilidad con los usuarios, así mismo el área técnica esta constantemente planeando y ejecutando proyectos para ir mejorando las infraestructura física del acueducto, se implementan actividades para disminuir los daños de las redes de distribución y perdida de agua en las tuberías, minimizando las perdidas de IANC, directamente en el subprograma técnico. \n'),
