(1613,64,2024,3,100.0000,'2024-04-26 03:40:29','2024-04-26 04:07:01',33,'El Indicador de Continuidad en la Recolección (ICTR) en el mes de marzo esta al 100% cumpliendo con la mesta establecida de acuerdo a los parámetros requeridos por el ente de control.\n\nSirve para evaluar la eficiencia y calidad de la recolección de los residuos en el municipio,  asimismo mide la continuidad y regularidad con la que se realiza la recolección de basura; para asegurar que se cumplan los estándares establecidos en el servicio de aseo.'),
