(1615,104,2024,3,100.0000,'2024-04-26 03:44:14','2024-04-26 09:42:53',33,'La calidad técnica de la recolección se refiere a la precisión y eficiencia con la que se recopilan datos, información o muestras en un contexto específico. Esta medida evalúa cómo se lleva a cabo el proceso de recolección, asegurando que los datos obtenidos sean confiables, consistentes y representativos de la población o fenómeno estudiado. Aspectos clave de la calidad técnica de la recolección incluyen:\n\nMetodología adecuada: Utilizar métodos de recolección apropiados para el tipo de datos que se están recopilando, ya sean encuestas, entrevistas, observaciones directas, mediciones físicas, etc.\nDiseño de instrumentos: Desarrollar cuestionarios, formularios de recolección u otros instrumentos con preguntas claras, precisas y relevantes, así como con formatos adecuados para garantizar la comprensión y la uniformidad en las respuestas.\n\nCapacitación del personal: Capacitar al personal encargado de la recolección para que siga los procedimientos establecidos y mantenga la consistencia en la aplicación de los instrumentos y la interpretación de los datos.\n\nSupervisión y control de calidad: Implementar mecanismos de supervisión para monitorear el proceso de recolección, identificar posibles errores o sesgos, y corregirlos de manera oportuna.\n\nValidación y verificación: Verificar la precisión y la validez de los datos recolectados mediante pruebas piloto, análisis de consistencia interna, comparaciones con fuentes alternativas, entre otros métodos.\n\nGarantía de confidencialidad y ética: Asegurar la confidencialidad de la información recolectada y cumplir con los estándares éticos y legales relacionados con la privacidad y la protección de datos.\n\nRegistro y documentación: Mantener registros detallados de todas las actividades de recolección, incluyendo fechas, lugares, procedimientos utilizados y cualquier otro detalle relevante que pueda afectar la calidad de los datos.\n\nAl garantizar una alta calidad técnica en la recolección de datos, se mejora la fiabilidad y la utilidad de la información obtenida, lo que a su vez fortalece la validez y la credibilidad de los resultados de cualquier estudio o investigación.\n\n'),
(1616,4,2024,3,45.6700,'2024-04-26 03:48:59','2024-07-24 03:19:38',33,'En el periodo de marzo en la cobertura de corte de césped se realizaron 239.021 mt2 en toda la zona urbana del municipio acorde a lo establecido por el PGIRS, lo que permite mantener con regularidad la apariencia y estética  de la ciudad.\n\nLo anterior refleja que del 80% de la meta establecida se esta realizando un 45..67% con un cumplimiento 57.09% esto señala que el indicador no esta cumpliendo con la meta pactada, lo cual refiere a la falta de personal para atender toda la cobertura establecida en el PGIRS.'),
