(1636,96,2023,12,-3059222558.4000,'2024-05-08 06:40:23','2024-11-14 06:54:34',3,'Para el periodo 2023, el Valor Económico Agregado (EVA) fue negativo, con un valor de -$3,059,222,558. Esto sugiere una baja capacidad de la empresa para generar valor y rendimiento. Analizando la situación, la entidad debería tener una utilidad neta antes de impuestos (UNA) mayor a $19,892,072,358.40 para cubrir su costo de capital ponderado (WACC) del 12.76%. Actualmente, la utilidad es de $16,832,849,800, resultando en un retorno sobre inversión del 10.80% y un EVA negativo. Además, la empresa tiene activos que superan en 4.3 veces sus pasivos sin obligaciones financieras, lo que refleja una falta de inversión y generación de valor.'),
