(1672,112,2024,4,95.3900,'2024-05-27 04:56:55','2024-05-27 04:59:03',27,'En el periodo de abril de 2024, el indicador se afecto en un 95,39%, el porcentaje no mejora, por falta de realiza brigada de cambio de medidores obsoletos y que se encuentran frenados, por no haber medidores en la empresa para financiar, además falta personal operativo en el área y la falta de instalar medidores en predios que tienen el servicio directo, se refleja el incumplimiento de las metas. y las brigadas de retiro de medidores para laboratorio.\n\nPor medio de comunicado personalizados, se da la opción al usuario de comprar el medidor y traerlo para la empresa y proceder a instalarlo. Dar cumplimiento al usuario con lo citado en el oficio de un periodo para instalar por parte de la empresa es importante para cumplir con las metas.'),
(1673,4,2024,4,61.1100,'2024-05-28 03:04:53','2024-07-24 03:24:47',3,'Durante el periodo de abril en la cobertura de corte de césped se realizaron 319.802 mt2 en toda la zona urbana del municipio acorde a lo establecido por el PGIRS, lo que permite mantener con regularidad la apariencia y estética  de la ciudad.\n\nLo anterior refleja que del 80% de la meta establecida se esta realizando un 61..11% con un cumplimiento 76.39% esto señala que el indicador no esta cumpliendo con la meta pactada, lo cual refiere a la falta de personal para atender toda la cobertura establecida en el PGIRS.'),
(1674,2,2024,4,100.0000,'2024-05-28 03:06:29','2024-12-17 08:14:34',3,'La cobertura de poda de árboles correspondiente al periodo de abril alcanzó el 100% de los árboles incluidos en el PGIR de 2470, cumpliendo así con la meta establecida.\n\nEste concepto hace referencia a la proporción de árboles podados en relación con el total de árboles presentes en un área. Es una medida clave para evaluar el mantenimiento y la gestión de las áreas arboladas, ya que una cobertura adecuada de poda favorece la salud, seguridad y estética de los árboles, además de contribuir al bienestar general del entorno urbano donde se lleva a cabo esta labor'),
(1675,11,2024,3,90.3600,'2024-05-29 07:28:17','2024-05-29 07:31:36',16,'este mes se da inicio a los contratos de mantenimientos preventivos y correctivos tanto de vehículos como de motocicletas.  Iniciando con vehícuos el 12 de marzo  y con motocicletas el 22 de marzo,'),
(1676,111,2024,3,93.7500,'2024-05-29 07:29:40','2024-05-29 07:32:15',16,'Se logra dar cumplimiento de lo proyectado en referencia a mantenimientos programados'),
