(1678,111,2024,4,87.5000,'2024-05-29 07:55:03','2024-05-29 07:58:31',16,'Se programan 8 motos y se logra realizar el mantenimiento a 7  la otra queda para el siguiente mes.'),
(1680,16,2024,4,1.0000,'2024-05-29 09:15:18','2024-05-29 09:22:14',20,'En el mes de abril del 2024 se tomaron muestras para determinar la de la calidad de agua para consumo humano como Control de la empresa Serviciudad esp.  Las cuales fueron 92 muestras fisicoquímicas y 92 muestras microbiológicas en la red de distribución en 15 puntos de muestreo, para ser analizadas en el laboratorio interno de villa santana. \nDespués de ser analizados los parámetros de las muestras por el profesional se concluye que sus aguas son aptas para el consumo humano en lo definido en la Resolución 2115 de 2007.\n'),
(1681,50,2024,4,0.0700,'2024-05-29 09:15:38','2024-05-29 09:19:10',20,'Después de analizar los resultados reportado por el laboratorio interno de villa santana en el mes de abril, donde se tomaron 92 muestras fisicoquímicas y 92 muestras microbiológicas. Con un resultado del IRCA 0.07% se clasifica el IRCA con un nivel de riesgo sin riesgo agua apta para el consumo humano, con Clasificación del IRCA: SIN RIESGO \n	\nSIN Riesgo	          BAJO 	         MEDIO 	     ALTO	                INVIABLE SANITARIAMENTE\n 0.0 - 5.0 %	        5.1 – 14 %      14.01 – 35 %	 5.1 - 80 %	               80.1 - 100 %\n'),
(1682,4,2024,5,61.8400,'2024-05-30 08:31:53','2024-07-24 03:28:54',3,'Para el periodo de mayo en la cobertura de corte de césped se realizaron 323.811 mt2 en toda la zona urbana del municipio acorde a lo establecido por el PGIRS, lo que permite mantener con regularidad la apariencia y estética  de la ciudad.\n\nesto señala que el 80% de la meta establecida se esta ejecutando un 61..84% con un cumplimiento 77.30% esto señala que el indicador no esta cumpliendo con la meta pactada, lo cual refiere a la falta de personal para atender toda la cobertura establecida en el PGIRS.'),
