(1760,50,2024,5,0.0400,'2024-07-22 10:09:18','2024-07-22 10:11:51',20,'Después de analizar los resultados reportado por el laboratorio interno de villa santana en el mes de mayo, donde se tomaron 95 muestras fisicoquímicas y 95 muestras microbiológicas. Con un resultado del IRCA 0.04% se clasifica el IRCA con un nivel de riesgo sin riesgo agua apta para el consumo humano, con Clasificación del IRCA: SIN RIESGO \n	\nSIN Riesgo	          BAJO 	         MEDIO 	     ALTO	                INVIABLE SANITARIAMENTE\n 0.0 - 5.0 %	        5.1 – 14 %      14.01 – 35 %	 5.1 - 80 %	               80.1 - 100 %'),
(1761,16,2024,5,1.0000,'2024-07-22 10:09:30','2024-07-22 10:11:33',20,'En el mes de Mayo del 2024 se tomaron muestras para determinar la de la calidad de agua para consumo humano como Control de la empresa Serviciudad esp.  Las cuales fueron 95 muestras fisicoquímicas y 95 muestras microbiológicas en la red de distribución en 15 puntos de muestreo, para ser analizadas en el laboratorio interno de villa santana. \nDespués de ser analizados los parámetros de las muestras por el profesional se concluye que sus aguas son aptas para el consumo humano en lo definido en la Resolución 2115 de 2007.\n'),
