(1789,48,2024,5,78.5700,'2024-07-30 05:44:21','2024-07-30 10:41:21',13,'La meta actual del 90% no se está cumpliendo el cual arrojo un 78.57 % para el mes de mayo, dado a que se están ejecutando contratos que llevarán a cabo la instalación de algunos macro medidores de caudal en el sistema de distribución de la empresa, adicional a esto se han presentado inconvenientes en algunos tanques, debido a estar en zonas susceptibles a descargas eléctricas\nLo que señala que el Índice de Macromedición Efectiva es esencial para asegurar que los sistemas de medición de la entidad operen de manera precisa, confiable y eficiente, a las salidas de los sistemas de potabilización, tanques de almacenamiento de agua potable y/o sistemas de bombeo\n'),
(1790,17,2024,5,23.8900,'2024-07-30 05:44:25','2024-07-30 10:37:46',13,'Se observa el indicador del índice de continuidad de acueducto al periodo de mayo presenta una frecuencia de 23.89 horas/día, a pesar de no lograr la meta establecida y con un cumplimiento de 99.83%, se encuentra muy cercano al 100% establecido en el IUS. \n\nLo que señala que el índice de continuidad de acueducto tiene la disponibilidad constante del suministro de agua potable, esto contribuye al bienestar de la ciudad asegurando un suministro de agua confiable y constante.\n'),
