(1798,112,2024,6,95.0400,'2024-07-30 08:45:42','2024-07-30 08:48:04',27,'En el periodo de junio de 2024, el indicador se afecto en un 95,04%, el porcentaje no mejora, por falta de realiza brigada de cambio de medidores obsoletos y que se encuentran frenados, predios directos a los cuales se retiro el medidor y fueron devueltos del laboratorio los cuales no se puede instalar y se deben devolver al usuario y no se ha realizado entrega de oficio de instalación de medidor por predio directo, donde la empresa compro medidores y por falta de personal operativo en el área no se ha realizado el proceso; se refleja el incumplimiento de las metas. y la brigadas de retiro de medidores para laboratorio fueron de 166 medidores.\n\nPor medio de comunicado personalizados, se da la opción al usuario de comprar el medidor y traerlo para la empresa y proceder a instalarlo. Dar cumplimiento al usuario con lo citado en el oficio de un periodo para instalar por parte de la empresa es importante para cumplir con las\nmetas, la entrega de oficios se hace muy lenta.'),
(1799,12,2024,6,98.8300,'2024-07-31 03:41:48','2024-07-31 03:47:25',3,'El indicador de cobertura de medición correspondiente al periodo de junio de 2024, se encuentra en 98,83%, se realizó brigada de 166 retiro de medidores frenados.\n\nCon relación a los comunicados a los predios que presentan novedades y son reportados por el área de facturación. se han enviado muy lentamente, esto debido a la falta del personal en esta unidad, los objetivo del contenido de los oficios no se cumple.\n\n'),
