(1825,59,2024,4,1.7200,'2024-08-15 04:30:30','2024-10-29 04:57:38',21,'En enero, el indicador de productividad operativo de aseo alcanzó un valor de 1.69, lo que representa un desempeño inferior a la meta de 1.78, con un cumplimiento del 94.94%.\n\nEste indicador mide la proporción de trabajadores operativos por cada 1.000 suscriptores del servicio público domiciliario de aseo. Su objetivo es evaluar y mejorar la eficiencia en la limpieza y mantenimiento de espacios públicos, lo que  requiere atención constante, así como ajustes proactivos a medida que se identifican áreas de mejora. Optimizar el uso de recursos no solo es fundamental para garantizar un ambiente limpio y saludable, sino que también contribuye a la satisfacción de los usuarios y al bienestar de la comunidad en general. Además, es crucial fomentar la capacitación del personal y la implementación de nuevas tecnologías que faciliten un mejor desempeño en las labores de aseo.'),
(1826,57,2024,4,1.0200,'2024-08-15 04:30:59','2024-10-29 03:09:33',21,'La medición se refiere a la proporción de trabajadores operativos por cada 1.000 suscriptores en el servicio público domiciliario de acueducto. Este indicador evalúa el desempeño y la eficiencia de los empleados encargados de operar y mantener la infraestructura de distribución de agua.\n\nEn abril, el indicador de productividad operativo de acueducto fue de 1.04, en comparación con la meta de 1.06, alcanzando un cumplimiento del 98.11%. Esto sugiere que, durante este mes, el indicador se acercó a la normalización según el IUS.'),
(1827,58,2024,4,0.3300,'2024-08-15 04:31:51','2024-10-29 03:27:24',21,'En abril, el indicador de productividad operativo de alcantarillado se situó en 0.33, frente a una meta de 0.45, lo que refleja un desempeño por debajo de lo esperado, con un cumplimiento del 77.33% en relación con la normalización según el IUS.\n\nEste indicador mide la proporción de trabajadores operativos disponibles por cada 1.000 suscriptores del servicio público domiciliario de alcantarillado. Evalúa tanto la eficiencia de los empleados que operan y mantienen la infraestructura como la efectividad en la gestión de los recursos humanos. Un desempeño insuficiente en este ámbito puede tener repercusiones en la calidad del servicio y en la satisfacción de los usuarios, subrayando la necesidad de implementar estrategias de mejora en la capacitación del personal y en la optimización de procesos operativos'),
