(1849,2,2024,6,100.0000,'2024-08-16 07:15:31','2024-12-17 08:28:33',3,'Para el periodo de junio de 2024, la cobertura de poda de árboles alcanzó el 100%, con un total de 2,470 árboles podados, conforme a lo establecido por el PGIRS. Esto indica que el indicador está cumpliendo con la meta fijada.\n\nEste hace referencia a la proporción de árboles podados en relación con el total de árboles presentes en un área. Es una medida clave para evaluar el mantenimiento y la gestión de las áreas arboladas, ya que una cobertura adecuada de poda favorece la salud, seguridad y estética de los árboles, además de contribuir al bienestar general del entorno urbano donde se lleva a cabo esta labor'),
