),
(1851,82,2024,6,100.0000,'2024-08-16 07:20:56','2024-12-18 02:39:06',3,'El mantenimiento continuo del césped durante el mes de junio se lleva a cabo siguiendo un plan detallado que abarca los 97 barrios del municipio, conforme al cronograma semanal elaborado por la cuadrilla. Este proceso se ejecuta cumpliendo al 100% con las directrices establecidas en el POIR, asegurando una cobertura eficiente y oportuna en todas las áreas\n\nSemana 1: Júpiter, Emaús Llano Asul, La Mariana, Parque de Venus, Acacias – Rosales, La Capilla, Santa Teresita, La Capilla vía La Soledad, Los Pinos, Los Guamos, Bosques de la acuarela Etapa 1-2 \nEstación Gutiérrez, Galaxia, Villa Carola, Avenida Galaxia - La Romelia, La Romelia, Cesar Augusto, Plan 3 Zona 7 Camilo Torres, Mercurio, Pueblo Sol Alto, Pueblo Sol Medio, Sinaí, Camilo Torres \nPueblo Sol Bajo, Altos de la Capilla, Libertadores, El Rosal, Los Naranjos, Boca Canoa, Laureles \nPiamonte, Jazmín - Luis Carlos Galán,\n\nSemana 2: Guadalupe, Guadualito, El Martillo - Nueva Granada, El Modelo, Maglosa, Barro Blanco, San Fernando, Lote CAM Incluye Bermas, Bermas Molivento Parque Molinos - Cámbulos de Molinos, El Progreso, Parque Milán, Los Cámbulos, Milán, Parque El Martillo, Avenida Las Torres, Girasol-García herreros, Colinas, CAM, La Playita, \n\nSemana 3: Parque Valher, San Judas, Makro, Papiro, Servientrega, El Balso, Teka - Zapan – Bambú, La Sultana, Altos de Santa Mónica, Aurora Alta - Media – Baja, La Floresta, Mirador del Lago, Villa Alexandra, La Graciela, Inquilinos, Santa Mónica, Rincón de la Pradera, Sede Social Japón – Cámbulos, La Pradera, Valher, Lago de la Pradera, Panorama Country 2, Panorama Country 1, Multifamiliares Panorama Country, Panorama Country 3, Laguitos, Violetas, Rotonda Lago de la Pradera, La Raquelita, La Ocarina, Villa Laura, Vallarta, \n\nSemana 4: Campestre B, Campestre C, Limonar, La Macarena, Campestre A, El Bohío, Parque Santa Isabel, Guayacanes, Villa del Campo, Campestre D, Los Olivos, Quintas del Campestre, Santa Isabel,  \n\nEste proceso permite evaluar la densidad y altura del césped, así como controlar el crecimiento de las hierbas, con el objetivo de mantener un césped saludable y bien cuidado, además de adonar la ciudad.'),
