(2075,83,2023,12,68.1812,'2024-11-25 05:46:02','2024-11-25 09:28:02',3,'Durante el Año Tarifario 7, comprendido entre el 1 de julio de 2022 y el 30 de junio de 2023, la entidad alcanzó un cumplimiento del 68.18% del POIR lo que indica no alcanzo la meta propuesta, con una inversión total de $4.090.869.672 destinada al servicio de acueducto. Este nivel de ejecución refleja el compromiso de la entidad con la implementación de los proyectos planificados, orientados a mejorar de manera continua la infraestructura y la calidad de los servicios ofrecidos a la comunidad.\n\nAdicionalmente, esta gestión evidencia la capacidad de la organización para optimizar el uso de los recursos, asegurando avances significativos en la cobertura y eficiencia del servicio de acueducto. Las inversiones realizadas no solo fortalecen la infraestructura, sino que también contribuyen a garantizar el acceso a un servicio esencial, promoviendo el bienestar de los usuarios y el desarrollo sostenible de las áreas atendidas.'),
(2076,84,2023,12,110.5399,'2024-11-25 05:53:54','2024-11-25 09:10:15',3,'Para el Año Tarifario 7, comprendido entre el 1 de julio de 2022 y el 30 de junio de 2023, la entidad alcanzó un cumplimiento del 100% en el POIR relacionado con el servicio de alcantarillado, logrando una ejecución total de $4.090.869.672. Estos resultados son un reflejo del firme compromiso de la entidad con la implementación efectiva de los proyectos planificados, asegurando mejoras continuas en la infraestructura y en la calidad de los servicios brindados.\n\nAdemás, este desempeño evidencia la capacidad de la organización para gestionar de manera eficiente los recursos asignados, promoviendo el desarrollo sostenible y fortaleciendo la confianza de los usuarios en los servicios ofrecidos. La inversión realizada contribuye significativamente al bienestar de la comunidad y al avance de la infraestructura del sector.'),
(2077,20,2023,12,93.7467,'2024-11-25 05:58:10','2024-11-25 06:33:56',3,'Al cierre del Año Tarifario 7  de la inversión acumulada contemplada en el Plan de Obras e inversiones Reguladas (POIR) del servicio de alcantarillado es del  el 100% con una inversión total de $16.619.546.886,46 respectivamente, Esto demuestra un alto nivel de cumplimiento en la planificación y ejecución de las inversiones necesarias para mejorar y mantener la infraestructura para el servicio de alcantarillado.'),
(2078,45,2023,12,100.0010,'2024-11-25 06:02:38','2024-11-25 06:34:28',3,'Al cierre del Año Tarifario 7, se ejecutó el 93.75% de la inversión acumulada contemplada en el Plan de Obras e Inversiones Reguladas (POIR) del servicio de acueducto  con una inversión total de $12.348.064.119,16 al finalizar el año tarifario, demostrando un alto nivel de cumplimiento en la planificación y ejecución de las inversiones necesarias para mejorar y mantener la infraestructura en el servicio de alcantarillado.'),
