(2096,50,2024,10,0.0400,'2024-12-10 07:01:51','2024-12-10 07:04:39',20,'Después de analizar los resultados reportado por el laboratorio interno de villa santana en el mes de octubre, donde se tomaron 99 muestras fisicoquímicas y 99 muestras microbiológicas. Con un resultado del IRCA 0.04% se clasifica el IRCA con un nivel de riesgo sin riesgo agua apta para el consumo humano, con Clasificación del IRCA:\n	\nSIN Riesgo	          BAJO 	         MEDIO 	     ALTO	                INVIABLE SANITARIAMENTE\n 0.0 - 5.0 %	        5.1 – 14 %      14.01 – 35 %	 5.1 - 80 %	               80.1 - 100 %\n'),
(2097,16,2024,10,1.0000,'2024-12-10 07:02:44','2024-12-10 07:06:54',20,'En el mes de octubre del 2024 se tomaron muestras para determinar la de la calidad de agua para consumo humano como control de la empresa Serviciudad esp.  Las cuales fueron 99 muestras fisicoquímicas y 99 muestras microbiológicas en la red de distribución en 15 puntos de muestreo, para ser analizadas en el laboratorio interno de villa santana. \nDespués de ser analizados los parámetros de las muestras por el profesional se concluye que sus aguas son aptas para el consumo humano en lo definido en la Resolución 2115 de 2007.\n'),
