(2133,31,2024,11,132.0552,'2024-12-30 04:38:56','2024-12-30 04:40:34',13,'El índice de perdida por usuario facturado es de 6,52 m3,  lo cual indica que se esta cumpliendo la meta en un 132% para el año tarifario 9 de julio del 2024 a junio del 2025, la meta para esta vigencia es del 100%, a corte de 30 de noviembre del 2024, gracias al esfuerzo del área comercial, que por medio de su personal técnico, esta constantemente valorando estrategias para ir modernizando el parque de micromedición, cumpliendo con especificaciones técnicas y adoptando tecnologías actuales, lo anterior con el fin de generar confianza y tranquilidad con los usuarios, así mismo el área técnica esta constantemente planeando y ejecutando proyectos para ir mejorando las infraestructura física del acueducto, se implementan actividades para disminuir los daños de las redes de distribución y perdida de agua en las tuberías, minimizando las perdidas de IANC, directamente en el subprograma técnico. '),
(2134,112,2024,11,94.1593,'2024-12-31 03:22:45','2025-01-03 10:15:54',27,'En el periodo de noviembre de 2024, el indicador se afecto en un 94,16%, para cumplir con el indicador se esta instalando medidor a predios que se encuentran directos, para este periodo no se realiza brigada de retiros medidores frenados, se realizaron 390 instalaciones de medidores por cambio.\nPor medio de comunicado personalizados, se informa sobre el estado del medidor, y se da la opción al usuario de comprarlo y traerlo para la empresa para ser instalado; por falta de un  auxiliar se encuentra atrasado el proceso de imprimir los oficios\n'),
(2135,12,2024,11,99.0006,'2025-01-02 04:03:43','2025-01-03 10:13:41',10,'El indicador de cobertura de medición correspondiente al periodo de noviembre de 2024, se encuentra en 99,00%, se realizaron instalaciones de 203 medidores aportados por el usuario, y 187 medidores aportados por la empresa, se realizó 26 retiros de medidores para laboratorio por PQR.\n\nCon relación a los comunicados a los predios que presentan novedades y son reportados \npor el área de facturación, se encuentra atrasado por falta de un auxiliar para complementar las actividades en el área micro medición\n'),
