(2137,66,2024,11,9.9453,'2025-01-02 04:03:43','2025-01-03 02:43:55',10,'A pesar de que no se esta cumpliendo la meta de 12.7 m3/susc.mes, al ser este un indicador creciente y se encuentra en 9,95 m3/susc.mes a corte de noviembre de 2024, el promedio del año tarifario 9 es 10,18 m3/susc.mes, los indicadores generales de agua no contabilizada se cumplen y están dentro de las metas esperadas.'),
(2138,67,2024,11,16.4696,'2025-01-02 04:03:43','2025-01-03 02:43:44',10,'Se esta cumpliendo la meta de 21.31 m3/susc.mes, al ser este un indicador decreciente y se encuentra en 16,47 m3/susc.mes a corte de noviembre de 2024, el promedio del año tarifario 9 es 17,37 m3/susc.mes'),
