(2140,74,2024,11,95.3628,'2025-01-02 04:03:43','2025-01-03 02:42:29',10,'Se esta cumpliendo la meta del 80,65% para el año 2024, que va desde enero a diciembre, al encontrarse en 95.36% mes a corte de noviembre de 2024,  el área comercial por medio de su personal técnico, esta constantemente valorando estrategias para ir modernizando el parque de micromedición, cumpliendo con especificaciones técnicas y adoptando tecnologías actuales, lo anterior con el fin de generar confianza y tranquilidad con los usuarios, así mismo el área técnica esta constantemente planeando y ejecutando proyectos para ir mejorando las infraestructura física del acueducto, se implementan actividades para disminuir los daños de las redes de distribución y perdida de agua en las tuberías, minimizando las perdidas de IANC, directamente en el subprograma técnico. '),
