(2154,16,2024,11,1.0000,'2025-01-02 09:31:37','2025-01-02 09:39:09',20,'En el mes de noviembre del 2024 se tomaron muestras para determinar la calidad de agua para consumo humano como control de la empresa Serviciudad esp.  Las cuales se tomaron 94 muestras fisicoquímicas y 94 muestras microbiológicas en la red de distribución en 15 puntos de muestreo, para ser analizadas en el laboratorio interno de villa santana. \nDespués de ser analizados los parámetros de las muestras por el profesional. Se concluye que sus aguas son aptas para el consumo humano, según lo definido en la Resolución 2115 de 2007.\n'),
(2155,50,2024,11,0.1500,'2025-01-02 09:32:32','2025-01-02 09:36:12',20,'Después de analizar los resultados reportado por el laboratorio interno de villa santana en el mes de noviembre, donde se tomaron 94 muestras fisicoquímicas y 94 muestras microbiológicas. Con un resultado del IRCA 0.15% se clasifica el IRCA con un nivel de riesgo sin riesgo agua apta para el consumo humano, con Clasificación del IRCA:\n	\nSIN Riesgo	          BAJO 	         MEDIO 	     ALTO	                INVIABLE SANITARIAMENTE\n 0.0 - 5.0 %	        5.1 – 14 %      14.01 – 35 %	 5.1 - 80 %	               80.1 - 100 %\n'),
