(2220,30,2024,11,96.6457,'2025-01-16 06:38:52','2025-01-16 07:22:21',28,'En noviembre de 2024, el indicador de cumplimiento de metas de continuidad del servicio de acueducto alcanzó un 96.65%, sin lograr la meta del 100% establecida en el PGR. Este incumplimiento se debió a dos incidentes relevantes:\n1.	El 2 de noviembre, un daño en la Planta el Rodeo dejó sin servicio de acueducto al 26% de los suscriptores.\n2.	El 3 de noviembre, se presentó un daño en el tapón instalado en la tubería de 16” de American Pipe, ubicada en el sector Rincón de la Pradera, junto al edificio Triada, afectando al 74% de los usuarios de la empresa.\nEstos eventos impactaron significativamente la continuidad del servicio durante el periodo evaluado.\n'),
