(2222,16,2024,12,1.0000,'2025-01-16 09:39:20','2025-01-16 09:43:18',20,'En el mes de diciembre del 2024 se tomaron muestras para determinar la de la calidad de agua para consumo humano como Control de la empresa Serviciudad esp.  Las cuales fueron 99 muestras fisicoquímicas y 99 muestras microbiológicas en la red de distribución en 15 puntos de muestreo, para ser analizadas en el laboratorio interno de villa santana. \nDespués de ser analizados los parámetros de las muestras por el profesional se concluye que sus aguas son aptas para el consumo humano en lo definido en la Resolución 2115 de 2007.\n'),
(2223,50,2024,12,0.0300,'2025-01-16 09:39:30','2025-01-16 09:42:15',20,'Después de analizar los resultados reportado por el laboratorio interno de villa santana.\nEn el mes de diciembre se tomaron 99 muestras fisicoquímicas y 99 muestras microbiológicas. Con un resultado del IRCA 0.03% se clasifica el IRCA con un nivel de riesgo sin riesgo agua apta para el consumo humano, con Clasificación del IRCA: SIN RIESGO \n	\nSIN Riesgo	          BAJO 	         MEDIO 	     ALTO	                INVIABLE SANITARIAMENTE\n 0.0 - 5.0 %	        5.1 – 14 %      14.01 – 35 %	 5.1 - 80 %	               80.1 - 100 %\n'),
