(2418,50,2025,1,0.0700,'2025-04-25 13:31:38','2025-04-25 13:35:33',20,'Después de analizar los resultados reportado por el laboratorio interno de villa santana en el mes de enero, donde se tomaron 97 muestras fisicoquímicas y 97 muestras microbiológicas. Con un resultado del IRCA 0.07% se clasifica el IRCA con un nivel de riesgo sin riesgo  agua apta para el consumo humano, con Clasificación del IRCA:\n	\nSIN Riesgo	          BAJO 	         MEDIO 	     ALTO	                INVIABLE SANITARIAMENTE\n 0.0 - 5.0 %	        5.1 – 14 %      14.01 – 35 %	  5.1 - 80 %	               80.1 - 100 %\n'),
(2419,16,2025,1,1.0000,'2025-04-25 13:31:44','2025-04-25 13:44:51',20,'En el mes de enero del 2025 se tomaron muestras para determinar la de la calidad de agua para consumo humano como control de la empresa Serviciudad E.S.P.  Las cuales fueron 97 muestras fisicoquímicas y 97 muestras microbiológicas en la red de distribución en 15 puntos de muestreo, para ser analizadas en el laboratorio interno de villa santana. \nDespués de ser analizados los parámetros de las muestras por el profesional se concluye que sus aguas son aptas para el consumo humano. Con una clasificación del IRCA, Sin Riesgo,  definido en la Resolución 2115 de 2007.\n'),
