(2428,32,2024,12,0.0006,'2025-04-28 15:49:53','2025-04-29 07:38:19',3,'Al aplicar la actualización del IPC a la tarifa aprobada en junio de 2016, y compararla con la tarifa que se viene actualizando cada vez que se tenga un acumulado de IPC de mínimo el 3%, la desviación dio 0.01\n\nLo anterior. indica que se esta dando cumplimiento al indicador para el periodo de diciembre de la  aplicación de costos de y tarifas  y la metodología tarifaria de alcantarillado.'),
(2429,4,2025,1,74.8860,'2025-04-29 07:49:13','2025-04-29 10:27:05',3,'El indicador corte de césped, de acuerdo con lo establecido en el Plan de Gestión Integral de Residuos Sólidos (PGIRS), para el periodo de enero de 2025, ha fijado como meta la ejecución de 565.660 metros cuadrados de corte de césped. Esta meta fue determinada con base en la actualización técnica realizada por la Secretaría de Desarrollo Agropecuario y Ambiental, este indicador permite monitorear el cumplimiento de las labores de mantenimiento del espacio público, contribuyendo al bienestar ambiental y a la adecuada gestión de zonas verdes.\n\nSin embargo, Serviciudad ha ejecutado un total de 423.600 metros cuadrados de corte de césped, con un porcentaje 74.89%, lo que representa un incumplimiento 25.11% frente a la meta establecida en el PGIRS. Esto implica un déficit de 142.000 mt2 césped mensuales, debido al poco personal y a la rotación que se tiene, lo cual evidencia una brecha significativa en la gestión '),
(2430,4,2025,2,47.4052,'2025-04-29 07:50:13','2025-04-29 10:30:14',3,'Durante el mes de febrero se mantiene el déficit en la ejecución de corte de césped , incumpliendo la meta establecida por la Secretaría de Desarrollo Agropecuario y Ambiental, que contempla la intervención de 565.660 mt2 de corte.\n\nLo que implica que Serviciudad está ejecutando un total de 268.152 mt2 de corte de césped al mes, esto representa un cumplimiento del 47.41% respecto a la meta definida en el Plan de Gestión Integral de Residuos Sólidos (PGIRS). con un incumplimiento 52.59% lo que implica un déficit mensual de 142.000 mt2 de césped, atribuible principalmente a la alta rotación de personal operativo y a la limitada disponibilidad de recursos humanos.\n'),
(2431,4,2025,3,47.4052,'2025-04-29 07:51:19','2025-04-29 10:34:21',3,'Se mantiene Durante el mes de marzo el déficit en la ejecución de corte de césped , incumpliendo la meta establecida por la Secretaría de Desarrollo Agropecuario y Ambiental, que contempla la intervención de 565.660 mt2 de corte.\n\nLo que implica que Serviciudad está ejecutando un total de 268.152 mt2 de corte de césped al mes, esto representa un cumplimiento del 47.41% respecto a la meta definida en el Plan de Gestión Integral de Residuos Sólidos (PGIRS). con un incumplimiento 52.59% lo que implica un déficit mensual de 142.000 mt2 de césped, atribuible principalmente a la alta rotación de personal operativo y a la limitada disponibilidad de recursos humanos.\n'),
(2432,2,2025,1,68.2109,'2025-04-29 08:08:48','2025-04-29 10:17:03',3,'El indicador de poda de árboles para el año 2025: De acuerdo con lo establecido en el Plan de Gestión Integral de Residuos Sólidos (PGIRS), se deben intervenir 2.504 árboles, con una frecuencia de poda de dos veces al año para árboles y seis veces al año para palmas. Esta meta fue definida con base en la actualización realizada por la Secretaría de Desarrollo Agropecuario y Ambiental, la cual responde a criterios técnicos de manejo silvicultural, seguridad, salud pública y conservación del paisaje urbano.\n\nSin embargo, Serviciudad ha ejecutado un total de 1.708 podas, con un porcentaje 68.21%, lo que representa un incumplimiento del 31.79% frente a la meta establecida en el PGIRS. Esto implica un déficit de 796 podas mensuales, dado a la rotación y al poco personal que se tiene, lo cual evidencia una brecha significativa en la gestión del arbolado urbano, \n'),
(2433,2,2025,2,68.2109,'2025-04-29 08:44:18','2025-04-29 10:16:23',3,'Se continua con el déficit de poda de árboles para el periodo de febrero, incumpliendo la meta que planteo Secretaría de Desarrollo Agropecuario y Ambiental, el cual se debe intervenir 2504 arbole y palmas.\n\nesto que refleja que Serviciudad sigue ejecutando 1708 podas mensuales con un porcentaje 68.21%, lo que representa un incumplimiento frente 31.79$ a la meta establecida en el PGIRS. e implica un déficit de 796 podas mensuales, dado a la rotación y al poco personal que se tiene, \n'),
(2434,2,2025,3,68.2109,'2025-04-29 09:34:11','2025-04-29 10:18:06',3,'Se continua con el déficit de poda de árboles para el periodo de marzo, incumpliendo la meta planteada por Secretaría de Desarrollo Agropecuario y Ambiental, el cual se debe intervenir 2504 arboles y palmas.\n\nEsto que refleja que Serviciudad sigue ejecutando 1708 podas mensuales con un porcentaje 68.21%, lo que representa un incumplimiento 31.79% .frente a la meta establecida en el PGIRS. e implica un déficit de 796 podas mensuales, dado a la rotación y al poco personal que se tiene, \n'),
(2435,5,2025,1,84.9862,'2025-04-29 10:44:23','2025-04-29 11:12:12',3,'Para el indicador de cobertura de barrido correspondiente al mes de enero de 2025, el (PGIRS) estableció una meta mensual de 6.745,80 kilómetros de vías a intervenir. Esta proyección fue definida por la Secretaría de Desarrollo Agropecuario y Ambiental con base en la planificación territorial y los requerimientos operativos de limpieza del espacio público, Asimismo, este indicador permite evaluar el desempeño de las actividades de aseo y ajustar, si es necesario, la asignación de recursos y personal.\n\nLo que indica que el área de barrido de la empresa ha ejecutado un total de 5733 Km con un cumplimiento del 84.99%, lo que representa un incumplimiento 15.01% dejando un déficit 1.013 Km dejados de barrer en el municipio, esto debido al poco personal que se tiene y a la rotación de estos, igualmente a las incapacidades que se presentan'),
(2436,5,2025,2,84.9862,'2025-04-29 10:45:00','2025-04-29 11:28:57',3,'Se continua con el déficit de cobertura de barrido para el periodo de febrero, incumpliendo la meta que planteo Secretaría de Desarrollo Agropecuario y Ambiental, el cual se debe intervenir 6.745.80 km de vías \n\nLo que señal que la empresa sigue ejecutando e interviniendo 5.733 km de barrido, con un cumplimiento del 84.99%, lo que representa un incumplimiento 15.01%, continuando con un déficit de 1.013 km dejados de barrer'),
