(2459,49,2025,3,92.9863,'2025-04-30 09:22:23','2025-04-30 09:31:00',27,'En el periodo de marzo de 2025 el indicador se afecto en 94,20%. No se ha realizado brigada de retiros para laboratorio, y se reemplazaron 529 medidores que presentaban problemas en medición, por falta de medidores para financiar, la empresa no ha realizado brigada para cambio de medidores por obsolescencia tecnológica, pendiente para instalar medidor a predios que se encuentran directos de los cuales se le ha devuelto el medidor al usuario por no cumplir con el error permitido en la medición.'),
(2460,12,2025,3,99.2347,'2025-04-30 09:23:00','2025-04-30 09:28:10',27,'El indicador de cobertura de medición correspondiente al periodo de marzo de 2025, se encuentra en 99,23%, para el periodo de marzo no se realiza brigada de retiros para laboratorio, y se realizaron el cambio de 529 medidores\nCon relación a los comunicados a los predios que presentan novedades y son reportados por el área de facturación. se han enviado a los usuarios, solicitando que compren el medidor, con el fin de no incumplir el objetivo del contenido de los oficios, este proceso se encuentra atrasado por falta de un auxiliar.'),
(2461,112,2025,3,93.7034,'2025-04-30 09:23:00','2025-04-30 09:27:07',27,'En el periodo de marzo de 2025, el indicador se afecto en un 93,70%, no se ha realizado el retiro de medidores para laboratorio por frenados afectando el porcentaje de medidores en buen estado, por falta de vehículo para transportarlo, y se requiere de tener medidores en la empresa para financiar y cambiar medidores por estar obsoletos y en mal estado.\nPor medio de comunicado personalizados, se solicita al usuario comprar el medidor y traerlo a la empresa, esto por no tener medidores  en cantidad para financiar, y se puede incumplir con el contenido del oficio, proceso que se encuentra atrasado por falta de un auxiliar.'),
