(2606,112,2025,7,93.6646,'2025-09-03 11:32:40','2025-09-03 12:04:19',27,'Se retiraron 92 medidores para laboratorio para su revisión por encontrarse con problemas en el registro de medición, se realizaron 409 instalaciones de medidor, es decir se cambiaron por estar frenados y además obsoletos.\n\nlas acciones a mejorar, para este periodo se asigno un funcionario de técnica para entregar oficios a los usuarios, donde se notifica el estado del medidor, para lo cual se debe reflejar los resultados para el periodo de agosto, se realiza un convenio de colaboración con la empresa Tecnocon para financiar el medidor en el documento equivalente'),
(2607,112,2025,6,93.9767,'2025-09-03 11:41:33','2025-09-03 12:09:15',27,'Se retiraron 55 medidores para laboratorio para su revisión por encontrarse con problemas en el registro de medición, se realizaron 345 instalaciones de medidor, es decir se cambiaron por estar frenados y además obsoletos.\n\nlas acciones a mejorar se ha visto afectada por no tener el personal para realizarla, como la entrega de los comunicados personalizados, y por no tener medidores la empresa, se está solicitando que el usuario compre el medidor y traerlo a la empresa, además no se cuenta con un\nauxiliar para este proceso'),
