(2609,12,2025,6,98.7787,'2025-09-03 11:44:38','2025-09-03 12:10:46',3,'El indicador de cobertura de medición correspondiente al periodo de junio de 2025, se encuentra en 98,78%,para este periodo se retiraron 55 medidores para laboratorio, por cambio de medidor se instalaron 406 aportados por el usuario.\n\nCon relación a los comunicados a los predios que presentan el medidor con inconsistencia en el registro de medición, y son reportados por el área de facturación, y requieren de su cambio o de revisión en el banco de pruebas, se encuentra en un estado muy lento por no tener las personas para hacerlo.'),
(2610,49,2025,6,92.8289,'2025-09-03 11:44:38','2025-09-03 12:29:43',3,'En el periodo de Junio de 2025 el indicador se afecto en 92,83%. en este periodo se retiraron 55 medidores para laboratorio, no se realiza una brigada en retiro, se reemplazaron 406 medidores aportado por el usuario, la empresa no tiene medidores para financiar, se ha estado entregando oficios a los usuarios notificando el estado del medidor,  que por falta del personal para realizar exclusivamente esta tarea se ha realizado muy lentamente.'),
