(2614,12,2025,5,98.8789,'2025-09-03 11:49:29','2025-09-03 12:13:07',3,'El indicador de cobertura de medición correspondiente al periodo de mayo de 2025, se encuentra en 98,88%,para este periodo no se ha realizado brigada de retiro de medidores para laboratorio por falta de personal, además por falta de medidores no se ha realizado brigada de instalación de medidor a predios que se encuentran directos, también se presenta dificultad para cumplir con la instalaciones de medidores aportado por los clientes.\n\nCon relación a los comunicados a los predios que presentan el medidor con inconsistencia en el registro de medición, y son reportados por el área de facturación, y requieren de su cambio o de revisión en el banco de pruebas, se está solicitando a los usuarios que lo compren, debido a que la empresa no ha realizado la compra de medidores, además el proceso de imprimir los oficios se encuentra atrasado por falta de un auxiliar y del personal para entregar oficios'),
