(2743,50,2025,9,0.2200,'2025-10-30 13:23:45','2025-10-30 13:36:47',20,'Después de analizar los resultados reportado por el laboratorio interno de villa santana, en el mes de septiembre, donde se tomaron 94 muestras fisicoquímicas y 94 muestras microbiológicas. Con un resultado del IRCA 0.22% se clasifica el IRCA con un nivel de riesgo sin riesgo agua apta para el consumo humano, con Clasificación del IRCA:  Sin Riesgo\n	\nSIN Riesgo	          BAJO 	         MEDIO 	     ALTO	                INVIABLE SANITARIAMENTE\n 0.0 - 5.0 %	        5.1 – 14 %      14.01 – 35 %	 5.1 - 80 %	               80.1 - 100 %\n'),
(2744,16,2025,9,1.0000,'2025-10-30 13:33:59','2025-10-30 13:37:45',20,'En el mes de septiembre del 2025 se tomaron muestras para determinar la de la calidad de agua para consumo humano como control de la empresa Serviciudad E.S.P.  Las cuales fueron 94 muestras fisicoquímicas y 94 muestras microbiológicas en la red de distribución en 15 puntos de muestreo, para ser analizadas en el laboratorio interno de villa santana. \nDespués de ser analizados los parámetros de las muestras por el profesional se concluye que sus aguas son aptas para el consumo humano. Con una clasificación del IRCA, Sin Riesgo, definido en la Resolución 2115 de 2007.\n'),
(2745,12,2025,9,98.6631,'2025-11-04 10:09:28','2025-11-26 15:20:01',3,'El indicador de cobertura de medición correspondiente al periodo de septiembre de 2025, se encuentra en 98,66 %,para este periodo se retiraron 125 medidores para laboratorio, y se realizó la devolución de 89 medidores a los usuarios los cuales no se podían instalar solicitando un nuevo medidor quedando con el servicio directo. en el terreno tenemos aproximadamente 585 predios directos.\nCon relación a los comunicados a los predios que presentan el medidor con inconsistencia en el registro de medición, y son reportados por el área de facturación, se requiere de su cambio o de revisión en el banco de pruebas, no se cuenta con personal para la entrega de los comunicados, se han enviado oficio a predios directos solicitando la instalación de un medidor de agua nuevo.'),
